INSERT INTO `Boards` VALUES (40,270,'August',1,0,10,2,'Arena Rules','Text',2),(41,270,'August',1,0,10,2,'Code of Conduct','Text',3),(42,270,'August',1,1,10,2,'List of Arena Hosts','Text',4),(43,270,'August',1,0,10,2,'Event Schedule','Text',5),(44,290,'August',1,1,10,8,'Information Resource','Please use this board to share information about GM functions, rules, and information.\r\r-- August',1),(50,290,'August',1,0,11,6,'What I need for adding caves','To make things stream-lined for adding of content the following is what I need when any content is submitted for approval and to be added to the game:\r\rHunting caves:\r\r1.) Maps fully designed and correctly tested for passability.\r2.) Coordinates for warp zones to and from rooms and for\r    placement of the map on the overworld.\r3.) Monsters with tiers and colors for their looks.\r4.) Bosses (color, and suggested AI think simple for now,\r    we can get more complex later.)\r5.) Item drops with icon numbers and colors, if they are equip\r    I need stats, and equip look/color and such.\r6.) Quests:  Fully scripted in text and designed out.  Npcs\r    can be created for this but should always consider adding\r    any npc with more purposes at a later time.  Entire looks\r    and functions need to be explained in request, dialog\r    separated for easy copy paste, etc.',4),(100,2,'August',1,1,4,8,'Alpha Phase','\r\r     Welcome to the Alpha Phase testing for Nexus: Kingdom of Han! We are really glad you have decided to join us to experience the content we have put together.\r\rNexus: Kingdom of Han Alpha Phase will be an ongoing process as we look to players to help us discover oversights, bugs, and adjustment planning.\r\rTake some time to enjoy the currently available content, we look forward to hearing your feedback!\r\r     Kudos,\r     --August',1),(142,2,'August',1,0,6,12,'Notice of Cave Changes','A few caves/monsters are switching around between level 37-60.\r\r    8 - 15 | Crystal Fox Cave           \r   15 - 20 | Han Sewer Cave               \r   20 - 25 | Stone Voodoo Dolls          \r   25 - 31 | Hive                         \r   31 - 37 | Poring Paradise            \r   37 - 43 | Mud Boars\r   43 - 49 | Kalbog Fae\r   49 - 55 | Haunted Valley    -Closed in progress\r   52 - 57 | Kingdom Walls     -Closed in progress\r\rLook for these changes to go into effect soon. Please provide feedback on the leveling experience by posting.',3),(144,2,'August',1,0,6,12,'Notice of Cave Changes 2','\r\r    8 - 15 | Crystal Fox Cave           \r   15 - 20 | Han Sewer Cave               \r   20 - 25 | Stone Voodoo Dolls          \r   25 - 31 | Hive                         \r   31 - 37 | Poring Paradise            \r   37 - 43 | Mud Boars\r   43 - 49 | Kalbog Fae\r   49 - 55 | Haunted Valley    -Content open\r   52 - 57 | Kingdom Walls     -Closed in progress\r\rLook for these changes to go into effect soon. Please provide feedback on the leveling experience by posting.',4),(145,290,'August',1,1,6,12,'New Cave Chart','Cave Chart\r\r   DNW - Dor Nalan Wilds\r  ICoH - Imperial City of Han\r\r<b>    Level  | Cave (Location XXX,YYY)\r<b>  ---------+-----------------------------------------------\r    8 - 15 | Crystal Fox Cave (ICoH - 77,24)\r   15 - 20 | Han Sewer Cave (ICoH - 115,93)\r   20 - 25 | Stone Voodoo Dolls (DNW - 28,62)\r   25 - 31 | Hive \r   31 - 37 | Poring Paradise \r   37 - 43 | Mud Boars (DNW - 063,037)\r   43 - 49 | Kalbog Fae (Kalbog Pass - 44,40)\r   49 - 55 | Haunted Valley (Seong Pass) (2 Houses)\r   55 - 61 | Tanzar Tiger Walls \r   61 - 67 | Serpent Cave \r   67 - 73 | Floradine Flower Cave \r   73 - 79 | Du Jang Firebirds (Kalbog Pass - 001, 009) \r   79 - 85 | Dor Sen Tower (Unknown Monster) \r   85 - 91 | Dor Seht Tower (Unknown monster \r   91 - 99 | Ogres 1 & 2 \r   99 +    | Zodiac Tower, etc',40),(155,2,'Francois',1,0,6,12,'NEW! Quests/Cave/Reputation','\r\r Hello citizens of Han!\r\r\r   Within recent events, Han has seen increased traffic. We are pleased to see our numbers rise, and as a result, we have discovered that the villagers of Han are in need of your assistance! Three new quests have appeared, each of them\rbearing their own rewards!\r\r<B> ~ Quests ~\r\r * The messenger of Han has reported having some troubles with\r wolves in Seong Lowlands, located to the west of Han. When \r you are available, please speak with the Han messenger to\r gain further details! You can locate him by heading to:\r                         (061 , 055) \r\r\r * Seamstress Yaki of Han is in quite a pickle, complaining\r of a leaky roof! If another storm happens to come through,\r all of her fabrics within the shop are bound to be ruined! \r Please seek out Yaki to further ask of what you can do for\r her. You can locate her by heading to:\r                         (060 , 075)\r\r * The spirit healer(s) of Han have sensed a rather odd\r presence lingering about the lands lately. A mysterious\r herb that is rumored to feed off of the dead has appeared\r and the spirit healer(s) could use your help in gathering\r it! To give your assistance head to either:\r                         (122 , 051)\r                                or\r                         (010 , 115)\r\r\r<B> Hunting\r\r  * A new cave has emerged deep within the Seong Lowlands,\r    just due West of Han. Brave adventurers beware, in order\r    to access this cave, you must be of the 55th insight!\r    Gather your friends together and fend off the beasts with\r    all of your might!\r\r<B> Imperial Standing\r\r   Imperial standing is now recorded and can be accessed by\rspeaking with any of the city guards to check your standing.\r\r<B> What is Imperial Standing?\r\r    Imperial Standing is a type of reputation that is rewarded\r   to players who complete quests while traveling throughout\r   Han. As your Imperial Standing rises, you will gain access\r   to unique vendor options from NPCs. The higher the stand-\r   ing, the greater rewards become. As the players of Han\r   discover new content, more will be revealed about what\r   to expect from this type of reputation.\r    \r\r\r\r           Han is eagerly awaiting travelers to discover\r            it\'s secrets! Be kind to your comrades, join\r              forces and together you can accomplish\r                         the unthinkable!\r\r-Francois\r\r((Please report any bugs on the bugs/issues board that you\r  may happen to come across, thank you.))',5),(175,2,'August',1,0,6,13,'Cosmos the Great','If you haven\'t met Cosmos yet, he\'s a wizard. He will be helping us crunch numbers and adjust each of the paths.\r\rIts important for us to understand the mechanics of how the paths are performing with everyone\'s playstyle.\r\rFeedback allows us to adjust and tinker. I encourage you to try other paths spells to see how everyone compares but feel free to group up with a friend and trial each of your abilties vs theirs.\r\rYou can post on the bugs/issues board anything you\'re noticing, believe me, we are reading everything!\r\rFeel free to reach out to us as well.\r\rAugust',6),(176,2,'August',1,0,6,13,'Flameguard is fun!','\r\rIt\'s tons of fun! It looks really cool too. Its easy to cast and watch the numbers roll in. Unfortunately it looks like its too easy to cast and watch the numbers roll in.\r\rIt hits for a bit too much damage vs a rogues serpent strike, or a warriors rage.  Poet\'s quake is on a cooldown and that restricks the damage output.. mages flameguard no cool down.\r\rThere\'s a few scenarios that fix this issue:\r\rWe could tweak the damage slightly, and put a cooldown. Cooldown would allow the damage to be higher and let a mage use this spell at optimal times.\r\ror\r\rWe could tweak the damage a bit extra, no cooldown, and allow mages to always have this added damage up, including allowing the damage to adjust based on numbers of targets hit.\r\rWe chose to trial the second option. Lets see how the tweak pans out. Please test, feeback from all classes welcome.\r\rAugust',7),(177,2,'August',1,0,6,13,'Rogue','Invisible has a buff with it now, test it out.. Feedback please.',8),(182,2,'Cosmos',1,0,6,13,'Cave Updates (HP & Exp)','\r  * All caves have had their monsters health and experience\r    updated/adjusted. Please go investigate for yourself..\r\r  * During  the recent flood, a cave entrance seems to have\r    opened unleashing a rather slithery foe..\r\r\r\r                               ..feeback is always welcome.',11),(201,2,'August',1,0,6,14,'Exp: Yeah it got flattened','Exp is a really difficult thing to perfect. We could crunch numbers for hours.\r\rRemember this is alpha.. people were getting level 50 in hours, level 99 in two days.\r\rWe want to be realistic about the road from 1-99.  We flattened it, and made it more difficult--remember we are still developing the far end of the game.\r\rWe\'re looking in to making sure classes can solo effectively or group when they like and enjoy exping at the same time.\r\rAsk these questions: (answer them on the community board)\r\r1.) Would you like lv1-50 to go fast, slow a bit 50-75, then slow a bit more 75-99?\r2.) Would you like exp to slowly make your way from 1-99 in an even manner.\r3.) Would you like exp to speed up every new cave 1-2 initially, and then slow off?\r\rThink of ways that you feel exp would be fun, yet still provide a challenge.  What time period do you think it should take to get 99?  (Would you like NTK\'s version of 99, I wouldnt...)\r',12),(204,2,'August',1,0,6,14,'Exp Adjustment #2','Basically.. doubled, with minor tweaking to make the next tier caves more desireable.\r\rLets see how this one pans out.',13),(259,2,'Francois',1,0,6,15,'Of Flame and Flora! (2 NEW caves!)','\r                   Greetings people of Han!\r\r\r   As Han continues to harbor new adventurers, the discovery\r of new caves become inevitable. We have seen the rise of\r Han\'s Imperial Legion, and now we have even more exciting\r news to share with you all! Two new caves have been disco-\r vered, bringing forth new challenges that await you! \r\r\r<B>                  * Floradine Flower Cave *\r\r    Han has made incredible attempts at keeping the growing \r wildlife at bay, protecting the citizens of Han from the \r harsh wildernesses that surround the imperial city. A recent\r uproar in activity has caused a band of flora to unite tog-\r ether to the south of Han, stirring madly within the Vogt\r forest. It is rumored that the flora are very powerful, and\r only the bravest of adventurers will be able to venture in!\r A magical barrier has been erected by the flora to protect\r them from any invaders! Take haste, comrades! If you are of\r the 67th insight, you may enter to face these vile growths\r and put an end to them once and for all! It\'s rumored that\r the leaders hold several magical items, but their use is\r still unknown.\r\r    Join forces immediately and head to the Vogt Forest!\r     Protect what is rightfully yours! When combined with\r      your allies, you\'ll be an unstoppable system!  \r\r\r<B>              Location: Vogt Forest - (079 , 024)\r\r\r\r\r\r<B>                    * Du Jan Volcano *\r\r   Since the dawn of time, Han has rested peacefully\r beside a massive Volcano; The Du Jan Volcano. This incred-\r ible volcano once cradled precious life at it\'s base, a\r small-knit village now engulfed in flames. This Volcano ser-\r ved the townsfolk of Han and Du Jan for many things. Irres-\r istable hotsprings, mining, gathering medicinal herbs or\r minerals, but now it houses something vastly different.\r\r    The sound of a thousand caws could be heard at the high \r rise of noon. With every caw, the ground had trembled. Farmer-\r s have reported that livestock have been acting very restless\r lately and the answer as to why became clear - Du Jang had\r woken once more from her slumber, causing a massive volcanic\r eruption to take place. As molten lava and ash littered the\r ground, many animals perished. But what is this? A strange\r event has happened, causing many of the wildlife to not only\r die off, but become that of flame itself! \r\r   Hundreds of creatures have taken both to the skies as\r phoenix and to the ground as forest critters, spewing lava\r as they continue to run rampant and amuck! Courageous men\r and women have been burned alive in attempt to stave off \r these vile creatures! Only the most formiddable foes rest\r within the Du Jan Volcano. Be prepared, brave adventurers,\r those who are of the 73rd insight may be able to fend off\r these monstrous, molten wildlife, no - firelife!\r\r   Legend has mentioned that the heat these creatures give\r off can cause steel itself to bend! Legend has also\r mentioned that the phoenix serves as guardian to a much \r deeper secret; The heart of the Du Jan Volcano, crafted\r deep within the molten earth in the form of lethal weaponry.\r What riches might run deep within the veins of Du Jan? \r What enemies might be lurking about at the base of the\r volcano? Only time will tell! Conjure all of your strength\r and charge head first into the Du Jan Volcano immediately!\r\r\r<B>             Location: Kalbog Pass - (001 , 008)\r\r\r-Francois\r\r\r(( If any bugs are found while testing out this content,\r   we urge that you post to the bug board immediately. If you\r   feel that the bug is of grave importance, please contact\r   a GM respectfully. Thank you))',14),(351,2,'August',1,0,6,17,'Updates / Stability','\r\rI apologize about the large number of resets and initial errors.  The server core was edited to adjust changes addressing stability. I am hoping that this results in fixes for a couple issues.\r\rLet me know if you come across anything behaving weird.\r\rThanks!\r\rAugust',18),(381,2,'Cosmos',1,0,6,19,'- Other Updates','\r - Bug with TNL not moving has been fixed.\r \r - Correcting Tough/Fine armors and helms.\r\r - All hand-items have been adjusted to be more\r   appropriate stats for their levels.\r\r - Coords to Cook/Butcher have been fixed on \'Points of\r   Interest\' with the town guards.\r\r - Fox cave monsters have had their Health and Experience\r   adjusted and the cave was respawned. Soon the other\r   caves will follow, just a bit more tweaking needed.\r\r\r\r',19),(384,2,'August',1,0,6,19,'Alternate Worlds','\r\r\rYeah, completely my fault. I loaded double map servers. How crazy is that...\r\rFixed.\r\rAugust',22),(401,2,'August',1,0,6,20,'New Display: Website','\rThe website has a new update! To keep up with changes within the Kingdom of Han you can now load up the website kingdomofhan.com and view the latest Dreamweaver posts from the main page.\r\rThis quick feature is just an example of the type of data that will be available once we load character stats and show rankings of players.\r\rIn other news, we are finalizing the armor quest, sorry about the delay!\r\rAugust\r\r',23),(402,2,'August',1,1,6,20,'Armor Quest','\rThe level 65 armor quest has been released to the public. Remember that this is just the first tier and there will be advancement to each story for each path.\r\rPlease report any bugs you may encounter and thanks for your patience.\r\r(Also thanks to Cosmos in his huge part in helping to provide the creative direction of the quests.)\r\rAugust',24),(426,2,'August',1,0,6,21,'Caves Blocked','\rJust for a short time caves will be blocked while the new leveling/experience plan is put into action.\r\rWe apologize if this interrupts any of your gameplay and we appreciate your understanding ;)\r\rAugust',25),(427,2,'August',1,0,6,21,'Spell Overhaul','\rI love spells. I also really love programming spells.\r\rWe\'ve been developing new spells for each of the classes that will enhance or expand the current toolbox they have or make gameplay more engaging and fun.\r\rI just want to mention that it\'s really important we hear feedback about class spells, because ultimately that will have a big impact on fun factor for each class.\r\rWe will be having a reset that will cause some spells to not allow you to learn them in addition to their previous versions.\r\rFor example: You can\'t learn all three Burn versions as a Mage and use each of them, that becomes little overpowerered.\r\rSome spells didn\'t have the code enabled to prevent the stacking of them, and that will be changing as I review each of them.\r\rPlease be aware that your spell list may become completely erased or filled with \"??\". You simply need to go forget all those slots and relearn the spells. All spells have been updated to have no cost.\r\rUpdating and making sure these spells are in the best working order will allow us to proceed with adding new spells. So stay tuned!\r\rAugust',26),(459,2,'Cosmos',1,0,6,22,'Bugs Resolved/Fixed','\r June 20:\r - Adjustments to monster HP/EXP has been implimented.\r - Copper Ore & Wool have had their deposit fee fixed.\r\r June 21:\r - A new quest has been added somewhere in the Kingdom.\r - Ore nodes not spawning has been fixed.\r - Ajustments to Poet \"Bestow\" spell.\r\r June 22:\r - The droprate for \"Emerald King\" has been increased.\r - Kalbog helm has been adjusted to show-on-character.\r\r  <~~~~~~~~~~~~~~~~~~~~~~~~~~ * ~~~~~~~~~~~~~~~~~~~~~~~~~~>\r\r** New content has been put on hold while the GM\'s fix the issue concering server crashes/freezing. We\'re trying to get this resolved ASAP.\r',29),(474,2,'August',1,0,6,25,'Lag / Crashing','\r\rWe are still attempting to find the source of server lockup. Please report what is occuring when you are disconnected due to a lockup or crash, this will help us narrow down the problems.\r\rBoss AI has been turned off on a lot of monsters to test if this is causing any issues.\r\rLag should no longer be present as the debug program is not loaded.\r\rAugust',30),(485,2,'August',1,0,6,25,'Boss AI','\r\rBoss AI is being turned back on to continue testing, just so you are aware.\r\rAugust',32),(488,2,'August',1,1,6,25,'Updates / Additions','\r\rGood news! The server remained online all day without lockup. I believe the offending code was corrected. As such, I added back in the boss AI and the room respawning system.\r\rWe will now start the next phase test to see that the additions remain stable as well!\r\rTo keep you busy we added in the next cave, its not highly complex, and the maps already were in-game. If the server remains stable through tomorrow more content will hit the game after that.\r\rThanks!\r\rP.S. We are currently looking for skilled map makers to join the team, if you have the skills please send Mina an nmail!\r\rAugust',33),(501,150,'Justice',0,0,6,26,'[F] - Send to Culprit','[*] Notice of Jailing [*]\r\rYou have been placed in a \"time-out\" for your actions. Please make sure to avoid doing these things in the future to keep you from ending up in the cells again.\r\r  Date & Time -------------- MM/DD/YYYY at ??:?? AM/PM (EST)\r  Location ----------------- ?\r  Reason for Jailing ------- ?\r',3),(502,150,'Justice',0,0,6,26,'Killout - Sage Abuse','\r  Date & Time -------------- 06/26/2015 at 12:31 AM (EST)\r\r  Location ----------------- N Gate - ICoH\r  Reason for Jailing ------- Sage Abuse\r\r<b>  ** Was caught making drug references on Sage.',4),(503,150,'Justice',0,0,6,26,'Daemon - AutoHunting','\r  Date & Time -------------- 06/26/2015 at 12:36 AM (EST)\r\r  Location ----------------- Fox Cavern\r  Reason for Jailing ------- Auto-Hunting\r\r',5),(505,3,'Cosmos',1,1,6,26,'Sage Law','\rThe following is a list of things NOT prohibited to be saged about.  If you wish to \'vent\' your frustration with one another, reserve it for private whispers or group-chat. Kingdom of Han is meant to be enjoyed by all players and it is fairly clear not everyone cares for the constant cussing.\r\rIf you have a complaint about how something has been implemented in the game, send a letter to one of the GM\'s describing your issue and we shall try to resolve it the best we can.\r\rSage was implemented in the game to help people talk amongst each other, find hunts and have social banter -- Not meant for saging obscenities.\r\rIf you choose to ignore this Law, be prepared to spend some time in the jail cells.\r\r  =========================================================\r\r<b>  Saging the following will land you in jail:\r\r  - Swearing.\r  - Drug references.\r  - Sexually references/conduct.\r  - Insults towards another player.\r',3),(516,290,'Cosmos',1,0,6,26,'Subpath Items (ATM)','\r  Weapon/Shield = Level 99\r  Hand items = Level 75\r  Helm items = Level 50\r\r\r<b>o. Knight\r---------\rWeapon - Last Rites\rShield - Mirror Shield\rHand - Stone Creed\rHelm - Knight\'s Helm\r\r\r<b>o. Gladiator\r------------\rWeapon - Tetsubo\rShield - Dragon\'s Skull \rHand - Power Ward\rHelm - Gladiator\'s Helm\r\r\r<b>o. Shadow\r---------\rWeapon - Requiem\rHand - Gripped Glove\rHelm - Shadow\'s Helm\r\r\r<b>o. Archer\rWeapon - Dragon\'s Longbow\rHand - Yugake\rHelm - Archer\'s Helm\r\r\r<b>o. Elementalist\rWeapon - Elemental Spire\rHand - Balanced Charm\rHelm - Elementalist\'s Helm\r\r\r<b>o. Seer\rWeapon - Destiny\'s Fan\rHand - Book of Fortunes\rHelm - Seer\'s Helm\r\r\r<b>o. Druid\rWeapon - Coiled Branch\rHand - Floral Ring\rHelm - Druid\'s Helm\r\r\r<b>o. Bard\rWeapon - Maelstrom\rHand - Musical Charm\rHelm - Bard\'s Helm\r',41),(586,290,'Mina',1,0,6,30,'KillOut\'s Alignment Idea','Elemental Alignments should be like choosing a subpath\r\rEG. Mage picks to follow the path of fire (More DPS)\r    Mage picks to follow the path of water (More Crowd control)\r\r\r    Poet picks to follow path of lightning (Healing/Support)\r    Poet picks to follow path of Earth (Healing/Enemy Debuffs)\r\r    Warrior picks to follow path of ____ (More vitas + Burst)\r    Warrior picks to follow path of ____ (More sustain dmg)\r\r Rogue picks to follow path of ____ (1v1 dmg specialization)\r Rogue picks to follow path of ____ (AoE dmg specialization)',42),(587,290,'Mina',1,0,6,30,'Retribution\'s Frozen Tundra','-I have noticed that no classes have a shield yet. While I am fully aware that making a \"shield quest\" is exactly like NTK I do think there needs to be one made. I\'m really hoping that whether this advice is taken directly or supports a current theory or whatever may happen, happens because it is driving me crazy that I only have a weapon and my other hand is empty.\r\r-In the interest of the title of this contest I think this will fit very well. A tundra is an extremely dangerous wasteland of ice that only the bravest of souls will venture forth into, but of course only if the reward is worth it...\r\rSo I submit to you an idea that meets all of your requirements: A new spell, item and hunting (/questing) area;\r\r-Beyond west gate, beyond the seong lowlands and expanding past the northern seong highlands lies The Frozen Tundra. Whispers through the imperial city tells tales of a legendary forge where defenders of an older time used to create the the most mighty of shields to bolster themselves from enemies. However, Blistering cold winds and jagged piers of ice prevent even the bravest of warriors from entering. Even if you wanted to go in there you absolutely would perish within SECONDS of entering. Hypothermia is inevitable as well as the dangerous terrain it was just be FOOLISH to even try...unless you had help that is. But who could possibly help you with this? the smith? No way all that steel would freeze you even faster! The butcher? Cmon, dont be foolish. I\'ve heard rumours through the seamstress that she could spin a fur coat withstanding even the most brisk of winds. Okay, so you crafted yourself a nice fur coat right, smooth sailing. You head on in and hey the seamstress was right...youre VERY warm. You walk along the path only to realize that you may not be frozen but the path in front of you is completely blocked by a pillar of ice. So what do you do? Burn it? Pff, Wouldn\'t even make it sweat. You make your way back into town asking everyone how on earth you could move a giant pillar of ice. Well, the thing is..maybe you shouldn\'t go through it...but over it. Naturally putting two and two together you go to the smith to see if maybe he can make you some sort of ice pick to grapple over it. He tells you to get some copper ore and wood and even some rope. You gather the items and return. He crafts you a brilliant grappling hook. Proud and determined you make your way back to the tundra and look right at the towering pillar of ice. You swing the hook with all your might and toss it right on over, no dice. You try once more gathering all of your strength and finally...it hooks. You climb over and...brilliant! As you peer over the ledge you see a GIANT open pit, and in the middle lay a simple looking anvil. Pretty mysterious, you\'d think that it\'d be more grand the way the townspeople spoke of it. You walk up to it and are stumped. All this way for an anvil...but no materials to make anything with...no directions. Nothing. Clueless and disappointed you make your way back into town. Maybe the smith knows more about this. You proceed to tell the smith of your journey and he too seems disappointed, \"A simple anvil, huh? You would think it would be giant or made of gold or something, no?\" Almost as if he was there with you when you thought the same. The smith thinks for a bit and a shimmer of light appears in his eyes \"Oh!\" he exclaims. \"I think I\'ve got something...\" He appears to be fumbling around through his belongings. He pulls out an old parchment and blows the dust off of it, right in your face naturally. Slightly annoyed but definitely intrigued you listen in. He reads to himself and says \"Hmph, says here that the anvil you found is definitely no ordinary one. Actually it acts as some sort of key.\" He looks at you equally as confused. You both think...key...to an anvil? It\'s not a door... Then, it hits you. it doesn\'t NEED to be a KEY exactly. (continuing in next mail)',43),(596,2,'August',1,0,7,1,'Spell Updates','\r\rYou may start to notice some spell changes taking place without reset, these are soft reset changes. These tweaks to spells will be slowly rolling out as we test.\r\r<b>One major note on this:\r\rA hidden cooldown is now present for zaps. What does this mean? Essentially that you will no longer be able to spam 3 of your zaps to get additional damage. They now all share this same cooldown.\r\rWe will be monitoring this change and slightly buffing/tweaking your best zaps to adjust for this.\r\rPoets already will see that their zap now clusters and hits additional targets.\r\rAugust',34),(612,2,'Francois',1,0,7,1,'Goblins and Goonies! (A NEW cave!)','\r                   Greetings people of Han!\r\r\r   As Han continues to harbor new adventurers, the discovery\r of new caves become inevitable. We have seen the rise of\r Han\'s Imperial Legion, and now we have even more exciting\r news to share with you all! A new cave has been discovered\r near the Kingdom Walls! \r\r\r<B>                     * The Kingdom Wall *\r\r   \r\r   \"I swear, I saw it with my own two eyes!\" a guardsmen\r    of Han belted out, scrambling to his feet.\r   \"It had disgusting green skin, razor sharp teeth, and\r    buldging eyes! It was...-- A Goblin on the Kingdom\r    Wall!\"\r\r  \"A.. Goblin, on the Kingdom Wall!?\" another guard\r   muttered.\r\r   \"YES! I saw it! I swear!!!\" \r\r   \"He\'s fibbing!\" a third guard gawked, gripping his\r   spear a little tighter. \"It\'s probably just a\r    kid, trying to fool with us! Goblins are just an old\r    wivestale we tell children to keep them in bed\r    at night!\"\r\r   Nearby, an empty barrel had fallen over by whimsical\r chance, causing the guards to stand alert. A sinister\r giggle crept out from the nearby shadows, causing the\r hairs on the necks of the guards to stand.\r\r\r   \"It\'s right over there by that barrel, I promise you!!\"\r  the frightened guard pleaded.\r   \r   A tiny disfigured foot poked it\'s way out from the\r shadows, pausing momentarily. Another foot accompanied it,\r before revealing it\'s entire hideous body to the guards.\r\r   It giggled, curling it\'s wicked hair between it\'s claws.\r  After a moment of stillness from shock, the guards\r  pointed their weapons at the ghastly creature. The little\r  goblin let out a small chuckle.\r\r  \"Meeee? A goblin!? No...  hehehe... US!\" \r\r   What was once one, turned to two, six turned into a dozen,\r and a dozen turned into five dozen.  \r\r   \"TO ARMS!\" the guards screamed! \r\r         --------------------------------------------\r\r<B>                 Citizens of Han, to arms!!\r\r    The rumors are true, Goblins do exist!! Goblins have\r  breached the Kingdom Walls, and we need your help in\r  protecting the city! Scour the Kingdom Walls as quickly\r  as you can, gather your comrades and don the mightiest\r  armors you have, for these foes are tough! \r\r  \r<B>        Location: Near The Northern Kingdom Wall of Han.\r\r-Francois\r\r(( When playing this content, please report any bugs that you\r   may find. We appreciate that you utilize our bug \r   board and that you give us necessary feedback as we\r   continue to add content to the game. Remember this this \r   is alpha, and your participation in helping us build a\r   great game is very much appreciated. Thank you!))',35),(672,2,'Francois',1,0,7,2,'Mogn! The Ogre Wastelands! (A NEW cave!)','\r                   Greetings people of Han!\r\r\r   As Han continues to harbor new adventurers, the discovery\r of new caves become inevitable. We have seen the rise of\r Han\'s Imperial Legion, and now we have even more exciting\r news to share with you all! A new cave has been discovered\r deep within the Kalbog Pass! \r\r\r<B>                     *  Ogre Wastelands *\r\r   \r   Fluttering as quickly as she could with her tiny wings,\r the Faebog Fag collapsed to the groud at the Eastern\r gate of Han. \r\r   \"Heeeelp!\" she squeaked out, gasping for air.\r\r   \"Heeeelp meeeee!!\" She pleaded.\r\r   A local citizen had knelt down beside the poor fae cre-\r ature and cradled her gently into his rough hands.\r\r   \"What is the matter?\" he asked.\r\r   \"Giant monsters have invaded the Kalbog Pass, with\r weapons the size of your body!!\" she claimed. \r\r   The tiny fae creature grew weaker, dramatically placing\r her forearm over her forehead. \"All I can remember is them\r screaming \"Mogn!\" and thrashing at everything in sight \r with their monstrous clubs! You must help us!! The Kalbog\r is being invaded!\" \r\r\r<B>   ---------------------------------------------------\r\r\r\r      Citizens of Han, it is now your time to act! A new\r enemy has appeared on the battlefield, deep within the \r wilds of the Kalbog Pass! Ogres have appeared, and they have\r caused quite amuck for the wildlife nearby! Once you are of\r the 91st insight, bring forth your mightiest men and women,\r fasten the strongest armors you may have, and venture in!\r Protect the Kalbog pass, and fight valiantly for the \r                          City of Han! \r\r\r<B>               Location: Near The Kalbog Pass\r<B>                    Level to enter: 91\r\r-Francois \r\r(( When testing new content, please report any bugs or\r   issues that you may come across by utilizing our bug\r   board. If there are several issues, please create a \r   master post rather than posting multiple times on the\r   board. Please enjoy the content and we thank you for your\r   continued participation in our alpha phase. Enjoy! ))',36),(769,2,'August',1,1,7,9,'Major Bug Fix','\rThe cloned/duplicate monster bug has been fixed!!\r\rA big thank you to the players that gave me feedback about the bug occurances and helped to test.\r\rPlease report any future occurances of the bug, or any issues related to the fix should they arise.\r\rAugust',37),(800,2,'Francois',1,0,7,12,'Argh! Protect Thy Booty! (A NEW cave!)','\r                   Greetings people of Han!\r\r\r   As Han continues to harbor new adventurers, the discovery\r of new caves become inevitable. We have seen the rise of\r Han\'s Imperial Legion, and now we have even more exciting\r news to share with you all! A new cave has been discovered\r far across the Halvung waters!  \r \r<B>             ------------------------------------- \r\r   Tano itched away at his thick beard, contemplating\r whether or not he should speak any more.\r   \r   \"Tell us if it is true, boatsman!\" a villager of Han\r    demanded.\r\r   \"Argh.\" Tano replied.\r\r   \"Tell us!\"\r\r   \"Gah..\" Tano said, placing the palm of his hand onto\r    the back of his head. \r\r   \"Aye... The rumors be true.\" he spoke, \"BUT! I will not\r    be takin\' any of ye south to that cursed shore!\"\r\r   \"What if they invade our homes!? They are savages, Tano!\"\r    spoke a worried mother.\r\r    As the conversation continued onwards, more and more \r people from the city of Han started to gather. Word has\r never ceased to spread so fast in such a city. Tano wiped\r the sweat from his brow and pointed out towards the\r group of worried cityfolk.\r\r   \"Arrgh.. For a handsome fee, I will take ye to the shore,\r  BUT ON NO ACCOUNT, may I add, will I be responsible for\r  yer deaths! For any of yas that die! To the gallows with\r  you should one of \'dem\' undead take ya soul.\"\r\r \r\r<B>                   * The Sinking Maiden *\r\r    \r    \"Be on alert..\" Spoke a brave soldier who held a dim-lit\r lantern in his hands, shaking like a leaf. His hair was\r white as snow, spiked bangs in the front with a generous\r knot of hair in the back.\r\r   As the brave adventurers continued to explore the Halvung\r shore, a dense fog enclosed around the group of comrades.\r Sounds of chains clanking started to chime off into the di-\r stance, accompanied by the sound of creaking wood.\r\r   \"We must be close..\" whispered a brave woman who also\r held a lantern in her hand. In the other, she held a spiked\r club high into the air, just in case of any surprise\r attacks.\r\r    The fog soon dissipated around the Halvung shore, revea-\r ling a massive, ethereal boat. \r\r    \"The legend is true.. The Sinking Maiden does exist!\" \r       \r\r   The stench of rotting flesh and a thousand pounds of\r  sulfur began to stagnate the air. Each member of the group\r became mortified by the very sight of pirates starting to\r flood the boat, but no.. These were not just ordinary\r pirates, but pirates of a different nature.. An undead\r nature.. . .\r\r\r   A pirate lifted his waterlogged forearm to pull the\r drenched moss from his decaying mouth to scream..\r\r<B>                         \"ATTACK!\" \r\r<B>  ---------------------------------------------------------\r\r\r    Citizens of Han! The Sinking Maiden has been discovered!\r Prepare yourselves, for the legend is true, the boat itself\r is haunted by the undead! What legend surrounds such a \r mysterious boat? Gather your wits, for these pirates are\r notorious and will do anything to put an end to Han as we\r know it! These terrible pirates have guarded the secrets of\r Han\'s past, secrets so old that are even older than our \r very own ancestors! What information might you find from\r exploring this sinking ship?! \r\r    What treasures may be buried within the confines of The\r Sinking Maiden? Only YOU can find out! If you are of the \r 95th insight and are brave enough to venture in, speak to\r Tano immediately! He can be found just south of The Seong\r Lowlands, at coordinates: 065 , 071. \r\r-Francois\r\r((Please enjoy the new content, but as playing, if you find\r  any type of bugs, please utilize our bug board immediately.\r  If you feel that the bug is of grave importance and is\r  possibly game breaking, please alert at GM immediately. If\r  you find multiple bugs [ex: tile bugs where you cannot walk\r  in several places that you should], please create a master\r  post for the bug board instead of multiple posts. Remember\r  that this is Alpha and we appreciate your continued \r  support!))',38),(823,2,'August',1,1,7,14,'Path Damage Adjustments','\r\rFair warning. We will be tweaking the damage output of classes to be more in line with one another.\r\rThis is an ongoing process. Crying about how you\'ve become more weak will not help the situation any. Please look at the bigger picture and understand we want all paths performing up to par with one another and we have a set goal for the number of mobs that can be killed by any given player in a certain timeframe.\r\rThat being said, again--the bigger picture is to take steps towards balance in both PvE and PvP.\r\rConstructive feedback is welcome. Complaining is frowned upon, we aren\'t doing this to upset you...\r\rAugust',39),(833,2,'August',1,0,7,14,'New Abilities & Changes','\rMages, Poets, and Rogues have new spells at their trainers:\r\rEnspell / Enspirit\rEnspell / Enspirit is a powerful magic enhancement that strengthens your spells and grows in power as you do.\r\rThese spells are similar to rages and allow mages and poets to keep up damage wise in solo/group play.\r\rWarriors and Rogues will still have a higher output of damage.\r\rRogues have had Invisible and Serpent Swipe changed.\r\rInvisible was given a cooldown but no longer falls off when attacking monsters. It allows you burst damage.\r\rHide was added to rogue\'s spells that allows you to stay hidden but does not increase damage. It can be over-written by invisible for the boost again but will make you visible once more when duration ends. Hide will fall off if you try and attack with it on. \r\rSerpent Swipe has had damage increased considerably, initial damage does much more and DoT of the poison is greater.\r\rWarrior has been scaled to do the most damage out of all classes when fully surrounded by monsters.\r\rThere will be more changes to come. All paths have been tested with current adjustments and we like what we see thus far.\r\rAugust',43),(862,151,'Mina',1,0,7,16,'Working Timeline','PLEASE NOTE THAT THIS IS A FANTASY TIMELINE AND DOES NOT COINCIDE WITH REALITY.\r\r\rYear - The Eight mold the lands that will become known as the Han Empire.\r\rYear - The first humans arrive in the lands.\r\rYear - The Seers become an integral part of the Han government.\r\rYear - Emperor Wu becomes the Emperor of Han.\r\rYear 972 - Emperor Wu appoints Yiaha as the Regent for Asako.\r\rYear 973 - Asako becomes the Empress of Han.\r\rYear 97? - Empress Asako founds the Imperial Legion; appoints Demil as the first High Commander.\r\rYear 976 (Asako 3, Spring) - Empress Asako founds the Scholars.\r',3),(882,150,'Mina',1,0,7,19,'AllyM - Autohunting','\r  Date & Time -------------- 07/18/2015 at 6:00 PM (EST)\r\r  Location ----------------- Poring Caves\r  Reason for Jailing ------- Auto Hunting',7),(883,150,'Mina',1,0,7,19,'Moogle - Autohunting','\r  Date & Time -------------- 07/18/2015 at 6:00 PM (EST)\r\r  Location ----------------- Poring Caves\r  Reason for Jailing ------- Auto Hunting',8),(886,2,'August',1,0,7,19,'Flameguard/Other Changes','\rWe will always be monitoring how paths play. Previously we nerfed the damage done by Flameguard the Mage ability because certain mages were casting only Flameguard and Heal/Ice Shield and \"auto\" hunting.\r\rThis is inappropriate gameplay, and could be considered botting. We want paths to be using their main abilities in nearly all situations. We recently gave back power to Flameguard but I was extremely disappointed to find Mages going back to same behaviors.\r\rFlameguard code was changed to increase cost of mana for repeated use. This mana increase continues to stack infinitely until the Mage uses other main spells.\r\rWe believe this is a fair change that does not affect players that are playing appropriately.\r\rAs always feedback is welcome. Should we discover other abilities or paths being played poorly, changes like this will be put into play.\r\rAugust',44),(893,151,'Mina',1,0,7,19,'+ Studied History Marks','- SoSo \"Griselda Lore\" marked by Mina\r\r\rApproved Scholars\r* SoSo',7),(897,151,'Mina',1,0,7,19,'+ Study with the Scholars Rules','Study with the Scholars Rules\r\r1.) Only approved Scholars may issue the legend mark.\r\r2.) Submissions must be strongly written and adhere to Kingdom of Han.\r\r3.) Submissions must be posted to \'The Scholarly Scroll\' even if a mark is not issued.\r\r4.) You may not mark yourself.\r\r5.) You may not issue a mark without an appropriate submission.\r\r\rFailure to follow these simple rules can result in expulsion from the Scholars.',9),(898,151,'Mina',1,0,7,19,'+ Study with the Scholars Post','~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r<b>            /-/--/-/| \r<b>           /_/__/_/ |    I M P E R I A L\r<b>           |=|==|=| |       O R D E R         \r<B>           | |  | | |          O F   \r<B>           | |  | | |    S C H O L A R S \r<B>           | |  | | |\r<B>           | |  | | /\r<B>           |=|==|=|/\r<B>           `\"`\"\"`\"`\r~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\rThis is a call to all citizens of the Empire! The Scholar\'s of Han are in need of your help! As they continue to dig through the worn and dusty tomes of the past hidden within the shelves of the library, other tales and histories are escaping their quills!\r\rWe call upon you to share with us the histories, stories, lore, and poems to help us record the history of this glorious kingdom. Those who aid us in our quest of knowledge, by providing credible and amazing histories of our lands, will be handsomly rewarded by the Scholars for their hard work and dedication.\r\r\rPlease submit your stories to Mina or SoSo.',10),(899,151,'Mina',1,0,7,19,'Subpath and Sects List','<b>                          SUBPATHS\r\r\rWarrior: Knight/Gladiator\rRogue: Archer/Shadow\rPoet: Druid/Bard\rMage: Seer/Elementalist\r --------------------------------------------------------------\r<b>                            SECTS\r\r\rEoghan - Warrior based, holy fire, virtues\r\rGriselda - Warrior based, darkness, mystery, battle\r\rMagus - Mage based, ice, magic, order\r\rInvoca - Mage based, fire, magic, natural disasters\r\rPraesidio - Poet based, dark, cultish, secretive\r\rRenova - Poet based, restoration, holy\r\rUmbra - Rogue based, torture, dungeons\r\rCelern - Rogue based, primal, jungle, animals',11),(900,290,'Francois',1,1,7,19,'Auto-hunting, program users, etc. ','\r\r    Recently, we\'ve had to deal with a few issues regarding\r a few players who have been using keyboard macro programs\r in order to hunt. This post is intended to pitch an idea\r towards what guidelines we should likely adopt here in \r the near future as we continue to progress in making this\r a great game.\r\r  * Keyboard programs which allow players to loop spells\r    and skill should be ALLOWED. If they have access to\r    these programs, they\'re going to use them, and we have\r    absolutely no way of stopping thme.\r\r  * People who use keyboard programs should be aware that\r    they are NOT allowed to leave their keyboard or the\r    screen while playing. This should be considered \r    auto hunting, and auto hunting should be ILLEGAL.\r  \r  * The way to determine if someone is autohunting, is to\r    physically appear as an archon or a GM and ask them\r    to speak or respond to us. If the player does not \r    respond within 3-5 minutes, they can be labeled as an\r    auto hunter and therefore deserve the following:\r\r\r     ~ Jail time for x amount of time. A legend mark is\r       optional, but mind you, we can roleplay this \r       type of issue and make the legend mark unique,\r       instead of making it an ugly jail mark.\r\r        \"Possessed by an idiotic witch, x time(s).\"\r        \"Put to shame as the town drunkard, x time(s).\"\r        \"Subjected to being the town dunce, x time(s).\"\r       \r\r   Whatever the legend mark may be, that is ultimately up\r to August to decide or for all of us to debate on, as I am\r unaware if he wants red marks in the game. One thing I do \r know that August does not want,- is botters or keyboard\r programming. We can\'t prevent it, lets be honest, all we\r can do is have a strict guildline to adhere to in hopes \r that people learn their lesson. \r\r    A spell should be casted on the player once they are\r jailed.\r\rName: GM punish player\rAethers: 0s\rTargetable?: No.\rDescription:\r\r    Once casted, a pop up is presented to the archon/gm.\r\r    \"Who will you be casting this spell on?\"\r\r    *enter player\'s name*\r\r    \"How many hours do you want this spell to last on\r     this player?\"\r\r    *enter desired hours*\r\r     The spell, once casted on the player, puts a full\r  spell/sklill/speech silence on the player for x hours.\r  That way, we don\'t have people popping out of jail, \r  immediately going back to auto hunting.\r\r\r     If caught third time and jailed three times (if you\r put in a legend mark, this will keep track of their history\r instead of us having to keep record), Ban them.\r  \r  Either for two weeks, or permanently, or 3rd is 2 weeks and\r  4th offense is permanently. \r\r   If you want, you can also make it to where we reduce\r   their stats the second time.\r\r   Regardless, this needs to be placed in our game prior\r to us going into beta; where it really counts.\r\r    If it were up to me, I\'d punish them in a much more\r terrible way, by stripping them of their armor, spells,\r resetting their level to 1, etc, but we can\'t necessarily\r scare away our player base either. Fool me once, shame on\r you, fool me twice, shame on me. \r\r    I believe that auto-hunting can be properly roleplayed\r with if we follow this guideline.\r\r-Francois\r\rPS: It\'s important that when jailing people for this, to mark\r    down their IP address. Remember that people can have\r    multiple characters and it\'s always good to know who may\r    be repeat offenders to keep an eye on them.',44),(909,290,'Francois',1,0,7,21,'The Dark Portal Instance','Description of this game mechanic:\r\r    The Dark Portal system is meant to serve as a unqiue\r cave in Han. Much like how chests appear in various rooms\r within the Fox and Ogre cave, this is exactly how this \r dark portal would work, except the locations would be\r spread all over the Imperial city of Han, Dor Nalan Wilds,\r Seong Lowlands, Vogt Forest, Village of Pinyan, etc.\r\r    This cave should only be accessible to players who are\r of the 99th insight, and this cave should be incredibly\r hard to battle through, almost like an instance perhaps.\r The rewards should be great, and the cave should have a\r timer on it once the players enter the cave. The way the\r players enter the cave is by getting to the portal and\r walking into it. \r\r    What\'ll happen is that the cave\'s portal will be on a\r timer, and once the timer is up, it spawns in a random\r location. a /broadcast will be mentioned (details below),\r accompanied by where the players can find the dark portal\r nearby. \r\r---------------------------------------------------------\r\r/sound 506 once\r/bc [Han Shaman]: Be vigilant, citizens of Han, I sense\r                  a dark presence nearby.\r/bc *A Dark Portal has appeared near coordinates (xxx , yyy)* \r\r/spell 377 repeated on loop at location (xxx , yyy) \r\rDuration that the dark portal is open for: 5-10 minutes.\ronce closed: \r/sound 506 once\r/bc *The Dark Portal has been sealed*   \r\r\r<B>                         - Mob List -\r\rMob 1: Lethal Cobra\r/disguise 893\rHP: ?\rDrop: ?\rUnique AI: ?\r\rMob 2: Horrifying Poltergeist \r/disguise 981\rHP: ?\rDrop: ?\rUnique AI: ?\r\rMob 3: Terrifying Gargoyle \r/disguise 1014\rHP: ?\rDrop: ?\rUnique AI: ?\r\r\r<B>                         - Mob Boss -\r\rName: Dark Sorcerer Tsu-Gua \r/Armor 131 14\r/crown 80\r/shield 28 1\r/weap 21 7009\r\rHP: ?\rDrop: ?\rDrop: ?\rDrop: ?\rDrop: ?\rUnique AI: ?\r\rIf defeated:\r/bc [Dark Sorcerer Tsu-Gua]: Noo!! I shall return!!\r/bc The Dark Sorcerer has been vanquished.\r\rIf not defeated:\r n/a\r\r\r   Please give me your feedback on this. I know it\'ll take\r a lot of programming, but once finished, it\'ll be an\r amazing concept added to our game that\'ll give the players\r a unique experience when playing on our server.\r\r-Francois',45),(910,290,'Mina',1,0,7,21,'Re: Jailing System','I like the spin on branding people with something other than jailing for these situations.\r\rI think August could code this all in to one format.\r\rI still think we should have \'jailing\' marks for more severe crimes. I also think that we should have a \'trial\' system. Remember the old jury trials back in TK?',46),(911,290,'Mina',1,0,7,21,'Re: Dark Portal','Great idea. I think we should pursue somethig like this.',47),(919,151,'Mina',1,0,7,21,'+ Scholar Roster','Senior Scholar and Administrator\rMina\r\rHigh Scholars\r\rScholars\rSoSo (Can help with studies)\rRetribution\rWewee\rEdge',13),(928,151,'Mina',1,0,7,23,'+ Scholar Roster','Senior Scholar and Administrator\rMina\r\rHigh Scholars\r\rScholars\rSoSo (Can help with studies)\rRetribution (Can help with studies)\rWewee\rEdge',14),(950,290,'Francois',1,0,7,27,'Inner Sects Blueprint II','   If players do not like waiting around for faith points\r to accumulate daily, introduce a gold sink into the game.\r Every point they want back again will cost 50,000 gold \r perhaps.\r\r   Upon leaving an inner sect, maybe they are not allowed\r to join another for x amount of days.\r\r   Remember that this is a rough draft blue print of the \r Inner Sects, and anything can be added or changed. I fleshed\r this out in a matter of thirty minutes, so feel free to\r give your feedback. This project won\'t be touched for a\r while, but it\'s good to have it written down and on the\r board for keepsake in the meantime.\r\r-Francois \r\rII of II',49),(952,290,'Francois',1,0,7,27,'Inner Sects Blueprint I','<B>                       Inner Sect Spells\r\rMagus - Group Ice Shield (a weaker version likely)\rUmbra - Five way nontargetable Invisible\rInvoca - Unique (possibly targetable) invoke\rCelern - nontargetable damage reflective shield\rRenova - Non-targetable regen + refresh\rEoghan - Unique Whirlwind\rGriselda - 3x3 vertigo + Dot AOE \rPraesidio - Unique targetable dark retribution\r\r<B>Spell names:                      Duration:\r\rMagus - Glacial Barricade            50s\rUmbra - Touch of Shadows             50s\rInvoca - Inferno\'s Invocation        x\rCelern - Nature\'s Reflection         7s\rRenova - Renova\'s blessing           18s\rEoghan - Vital Strike                x\rGriselda - Dark Emanation            6s/15s\rPraesidio - Chaotic Blast            x\r\r              Every spell has 500s aethers.\r\rNote: Griselda\'s spell is 6s for vertigo, 15s for dot.\r\rSpell graphics:       Sound:\rMagus - 99             32 \rUmbra - 181            52 \rInvoca - 94            41\rCelern - 62            47 \rRenova - 259           725 \rEoghan - 9             14\rGriselda - 292         42 \rPraesidio - 200        27\r\r<B>               Inner Sect overall functions\r\r    Inner Sects will serve as unique gameplay to the players\r to where they can join an inner sect and reap the rewards\r from whichever temple they choose. While each Sect will \r reward players with a unique spell, there are also other\r perks that every sect will have. Players will be rewarded\r 1 point of faith if they choose prayer, and they can\r only pray or supplicate up to 10 times each day. The other\r NPC options do not take away their daily 10 pts.\r\r\"Prayer\" - An NPC function that grants the player faith.\r           The faith will be tallied, and is reset upon\r           obtaining the next rank in line.\r\"Observe Faith\" - Allows player to check faith points.\r\"Ascend\" - Allows player to get next ranking.\r\"Summon hopeful\" - An acoloyte+ ability that allows players\r                   to summon non-followers inside the temple.\r\"Initiate follower\" A priest+ only ability that allows\r                    players to initiate others into the\r                    faith.\r\"Supplicate\" - An NPC function that brings the player to\r           another option list, offering the following:\r *Temple parchments* - An scroll that returns players to\r                       their temple. Trade and droppable.\r *Blessing of (faith name)*, Grants ASV, full vita/mana\r                             heal. ASV lasts 1,000s, and\r                             grants entire group ASV if\r                             they are grouped.\r *Mass* - Allows a Priest or higher to initiate mass,\r          giving all of the people in the temple an edible\r          item that gives a good amount of hp/mp, along\r          with 5-10 points of faith and a legend mark.\r   \r\r\r<B>                  Inner Sect Legend Marks\r\r\rUpon initiation:\r\rSwore an oath to the faith of Eoghan, indoctrinated by (name) Year/Season\r\rUpon Initiating people: \"Has initiated (x) people to\r                         the faith of (name).\"\r\rUpon attending mass: \" Has attended mass (x) time(s).\" \r\r<B>        Ranking marks that get replaced as you rank up:\r\rWorshipper of Eoghan, Year Season - 0 faith pts needed\r\rAcolyte of Eoghan, Year Season - 30 faith pts needed\r\rPriest of Eoghan, Year Season - 300 faith pts needed\r\rCleric of Eoghan, Year Season - 500 faith pts needed\r\rMinister of Eoghan, Year Season - 1,000 faith pts needed\r\rHigh Priest of Eoghan, Year Season - 2,500 faith pts needed\r\r\r  Aside from the points needed, other requirements can \r also be introduced tha must be met. example: In order to\r get Priest of (Name), must be level 99. In order to get\r Cleric of (Name), must be ??hp/??mp, etc.\r\r  Players should be able to enter inner sects starting at\r level 75, or level 99.\r\r  Leaving faiths will be costly like leaving a subpath.\r All of your legend marks will disappear, your spell,\r and maybe costs some stats. \r\rI of II',50),(959,290,'Francois',1,0,7,28,'Subpath Tribute System','<B>                    Subpath Tribute System\r\r   The Subpath Tribute System is created and designed in order to give Subpaths a fair chance at obtaining new and unique content / additions to their paths equally. This system that has been created, is meant to draw Subpaths together to work as a team in order to get what they want.\r\r<B>                        How It works:\r\r All of the 8 Subpaths will have the option to vote on what they would like to see added to their path. Examples:\r\rA Subpath Weapon\rA Subpath Hand item\rA Subpath Legend Mark\retc.\r\r Upon voting if there is a tie, a GM or Archon will stand in place as the Ninth vote to break the tie. All of the subpaths will continue to vote until they are left with the final option. Once the option is finally discovered, All 8 subpaths will be given a mass tribute quota that they have to meet TOGETHER. Example:\r\rSay that the Subpaths finally reach the end of the voting process and ruled that A Subpath Weapon is going to be their next Subpath addition. The GMs/Archons will give a \"Total Subpath Tribute Yield\" that must be met in order for EACH subpath to get their weapon at once. Say that 1,000,000 points must be met, and each event hosted by individual subpaths yield 500 points per event. (These are just wild numbers, mind you).\r\rWhat this means is that Seers can host 1,000 events, and toss a total of 500,000 tribute points into the Subpath weapon pool, and then all of the other seven subpaths can host x amount of events to eventually meet the other 500,000 points needed to total the 1,000,000 quota to allow every subpath to obtain their weapon. (although, lets be realistic, lets not make all of the Seers do the work!)\r\r Upon reaching the yield, each subpath will be given their weapons. The same will work for Legend marks, Hand items, etc. \r\rNOTE: Subpaths will have their contributions recorded, and there will be a total tally post at the very end of each yield to show which subpath has gained the most and also which subpath has contributed the least. Working as a team with this type of system is heavily encouraged!\r\rThe Subpath that contributed the most points from the last round will have their vote counted as TWO instead of the standard ONE when choosing what addition subpaths will receive next.\r\rThis type of subpath system is put in place to insure that each subpath is treated equally, while still allowing each subpath to have unique looking weapons, spells, legend marks, hand items, etc, AND also to prevent the workload of our GMs to become unbearable.(Imagine 8 different subpaths attempting to all gain a unique type of benefit to their subpath, that would require 8 different types of code, possibly 8 different types of tribute yields, etc.) on top of the Gms already trying to code additional content that doesn\'t even deal with Subpaths.. It\'d be a mess!\r\rAnd yes, each weapon would be unique to each Subpath. Every Subpath wouldn\'t have the exact same looking weapon, the same stats, the same hand item, legend mark, or spell. We aren\'t that evil, are we? We may have Archons or GMs sit down with each of the Subpath leaders individually to find which weapon, armor, spell, or mark, etc. would be suitable to them. Keep in mind that it is the GMs who have the final say in what gets added and what is unacceptable.\r\rWe wish to bring an experience to Subpaths that will be unrivaled by all other Subpath systems that have been created, as we sincerely believe in the fairness and equality of all of our players. We hope that you enjoy playing on our Server and remember: Working together as a team is ideal!\r\r-Francois',51),(974,290,'August',1,1,7,30,'Server Backup 7-30-15','\rI\'m going to start posting dates that I do full backups of all the data. During alpha we will not be saving any additional log information. That means no whisper/say logs, no spell logs, no item or any other drop/exchange/etc logs.\r\rAfter alpha/beta we can start to save backups of data that includes all of those extra things. As of right now I delete it.\r\rCurrently the data that is saved is as follows:\r - All code/maps/database information that makes up the game\r - All lua/system code that makes spells/scripts/interaction\r - All core files that make up the engine\r\rIf we were to ever have a full crash/wipe/tragic error the data will be saved and backed up for at least every two weeks.\r\rLet me know if you have any concerns.\r\rAugust',52),(1012,2,'Francois',1,0,8,2,'The Dark Kingdom III','\r   \"I did what was necessary. I banished him into the\r dark plane, where no mortal should dare tread. It was \r the only choice I had to buy us some time.\"\r\r   \"Some time!?\" The soldier shouted at her. \"He\'s going to\r come back and his strength will be tenfold of what it is\r now! You have doomed us all!\"\r\r   \" SILENCE!\" She screeched.\r\r  \"Soon...\" she said, clutching onto her staff for support,\r \"Soon.. We will have to head into the portal and\r  defeat him once and for all.\"\r\r\r                    \"Tsu-Gua must fall.\"\r\r\r                       To be continued\r\rIII of III',45),(1013,2,'Francois',1,0,8,2,'The Dark Kingdom II','\r    The Shaman scurried over to a nearby tombstone. With\r a little bit of strength, she pried open the lid and\r retrieved an old weapon and a vial of discolored,\r murky liquid.\r\r  \"What are you doing?\" one of the spirits asked.\r\r   \"Saving this empire from certain doom.\" she replied.\r\r   The Shaman generously lathered her weapon with the\r murky liquid, rubbing every drop into the sockets of her\r skull staff. After a little bit of polishing, she lifted\r the staff into the air to inspect it further.\r\r   \"This will do.\" she said.\r\r\r   Tsu-Gua remained on the battlefield, basking in the \r blood of the fallen soldiers. The dark sorcerer spared not\r even a single soul, sending children to their demise. \r Baleful laughter bounced off of the Kingdom walls and\r entered the homes of terrified city folk.\r\r   \"You shall all meet certain death!\" Tsu-Gua cried out,\r blasting bolts of dark energy in every direction. \r   \r   Soldiers looked onwards, mortified as they witnessed pools\r of dark matter creep from the earth. Men that became entan-\r gled in the webs of darkness eventually collapsed to the\r ground, their bodies forming into hideous amalgamations of\r dark stone. \r\r   \"Tsu-Gua!\" The Shaman yelled.\r\r  Tsu-Gua turned his attention towards the calling of his\r name. \r\r   \"Yes, deary?\" He called out while still lashing out\r bouts of dark spells onto the crowds of soldiers.\r\r   \"Face me!\" she demanded. \r\r   Tsu-gua laughed, sauntering his way over to the shaman.\r\r   \"A woman, wishes to challenge me? You will simply\r fall like the rest.\" he said, bestowing a hideous grin.\r\r   The Shaman withdrew her skull staff and waved it to\r and fro. \"Guess again.\" she said, giving him a wink.\r\r   The grin on Tsu-Gua\'s face immediately retreated. His\r eyebrows narrowed and his nose crinkled. The potent \r scent of the staff stifled the air, cuasing Tsu-Gua to\r struggle with breathing.\r\r   \"You wouldn\'t... dare!\" he snarled, pointing his blade\r to the shaman.\r\r   \"Oh, I would.. And oh, I am.\" she replied.\r\r   \"You would send ME to the dark plane!?\" he snapped. \"I\r AM THE EMBODIMENT OF DARKNESS, FOOL!\" \r\r   \"I banish thee, Tsu-Gua, to an eternity of everlasting\r darkness!\" the shaman cried out, charging at Tsu-Gua\r\r   In an epic clash of, a massive blast of powerful energy\r rippled from where the two met, decimating the nearby land.\r Gales of wind lashed out across the entire empire of Han,\r sending debris flying in every direction possible. The\r onlookers shielded their vision from sight, as the bright-\r ness was nearly too much to bear.\r\r   Eventually the winds came to an abrupt halt, and the\r blinding light also soon faded from sight. The shaman\r fell to knees, weakened from the ordeal. Tsu-Gua was\r nowhere to be found.\r\r   \"Are you alright?!\" A soldier asked.\r\r  The soldier grabbed her arm and wrapped it over his\r shoulderspan, carrying her away to safety.\r\r   \"I will be fine...\" she replied in paused breaths. \r\r   \"It is not over.\" she spoke.\r\r   \"But Tsu-Gua is gone!\" he cheered. \"TSU-GUA IS GONE!\" he\r yelled to the soldiers. \"HUZZAH!\"\r\r   The soldiers cheered, raising their weapons in victory.\r\r   \"He is not gone!\" the Shaman quickly replied.\r\r   \"What do you mean? You defeated him!\"\r\r   \"I did not... I simply sent him away. And he will be\r back soon if you do not heed my warning.\"\r\r   The Shaman propped herself up on a nearby rock, pointing\r to the site of impact. \r\r   \"Watch.\"\r\r\r   The soldiers sat in silence, waiting nervously. A small\r bout of wind picked up, cuasing a whistle to stream\r through the air. Slowly, a minor mass of darkness started\r to form. As it grew in size, the speed of this dark ball\r of energy started to toil and churn, eventually exposing \r a massive dark portal.\r\r    \"He is trying to return.\" the shaman said, exasperated.\r\r   \"What did you do!?\" The soldier asked.\r\rPart II of III',46),(1014,2,'Francois',1,0,8,2,'The Dark Kingdom I','\r   \"Please... Spare me!\" The villager choked out.\r\r   The sinister presence let out a coy laugh, tightening\r his grip around the villager\'s neck.\r\r   \"And why should I pity you over anyone else?\" he asked.\r\r      The villager cried out, his last breath expelled from\r his lungs in a frantic plea for the sake of his family.\r\r   \"I have.. Chi-..Children.\" the poor man pleaded.\r\r   \"What a shame.\"\r\r   A guttural noise remained trapped within the villager\'s\r throat as the dark presence applied even more pressure, \r crushing the man\'s larynx into his own spinal cord. With a\r swift motion of his hand, the now lifeless body was tossed \r to the side like a rag doll, joining the alarming mass of\r bodies that had already lay strewn about the kingdom.\r\r   A frail woman screamed in horror, running to the aid of\r her now deceased husband. She cradled his battered corpse\r into her arms. Her face became drenched in rivers of salt\r as she rocked him back and forth.\r\r \"What are you!? Who are you!? You monster!\" She screamed,\r choking back on her own tears.\r\r   A wicked smile crept onto the face of the dark presence.\r He approached the grieving woman with ease, kneeling beside\r her. He lifted his pale, gaunt hand to the woman\'s head and\r gently whispered into her ear.\r\r \"Tsu-Gua,\" he replied, \"Darkness Incarnate.\" \r\r   She quickly smacked away Tsu-Gua\'s hand, dropping her\r husband\'s body to the ground.\r\r   \"Oh come now, there is no need for such hostility.\" he\r spoke.\r\r   \"LEAVE US!\" she cried out, \"Your dark sorcerery is not\r welcome in these lands! The Empress shall have your head!\" \r\r   Tsu-Gua took his hand towards the pitch-black skies, \r conjuring forth a tremendous amount of energy. Streaks of\r lightning stretched across the horizon as he continued to\r gather his powers, cultivating a mass of dark energy into\r his possession. He approached the helpless woman, now\r wielding a mighty blade in his hands.\r\r   \"Bow to me.\" he demanded.\r\r   \"I\'d devour a thousand rotwither before I bowed to\r the likes of you.\" she retorted, spitting to the ground.\r\r   \"So be it.\" he replied.\r\r   With his blade raised, the hollowed sockets within his\r skeletal face resonated, gleaming his golden eyes down\r upon the helpless woman. He swung down upon her, casting\r her body into blackened stone.\r\r   \"Han is under attack!\" A soldier screamed. \"To arms!\"\r   \"Bolster the defenses! Close the kingdom gates and\r    protect the empress at all costs!\"\r\r   A wall of soldiers formed in the nearby distance readied\r for an impending attack. Tsu-Gua snickered and marched\r his way directly to the men.\r\r   \"Fools, the lot of you!\" he exclaimed. \"So long as I draw\r power from the totems, your strength is incapable of sur-\r passing my own!\"\r\r   \"CHARGE!!!\"\" \r\r   In a full on assault, the army went forth into battle\r with the mighty dark sorcrer. One by one the soldiers\r perished in the heat of battle, falling to the dark magics\r of Tsu-Gua.\r\r  \"You will all perish!\" Tsu-Gua said, cackling.\r\r\r   Meanwhile, the empire\'s Shaman became bearingly over-\r whelmed with the alarming number of lost souls arriving\r at her doorsteps.\r\r   \"Please, you must save me!\" A wandering soul begged to\r the shaman. \r\r   The shaman ran around frantically, tossing various potions\r and scrolls from the shelves. Souls continued to pour\r into the room, pleading to be reuinted with their bodies.\r\r   \"It\'s not working!\" the shaman exclaimed, smashing a\r potion onto the ground by accident.\r\r   \"No matter what I do, my own magic cannot save you! \r Why is it that your soul is not returning to your body?!\"\r\r   \"Our bodies. . .\" one of the ghosts whimpered,\r     \"Have... been turned.. to stone...\"\r\r   The shaman stopped in her tracks, turning to the ghost.\r\r  \"Your bodies have been turned into.. WHAT?!\" she shouted.\r\r \"The Dark Sorcerer has encased our bodies into dark stone!\" \r\rPart I of III',47),(1015,2,'August',1,1,8,2,'Event Runs through 8/9','\rI hope you guys are enjoying the event. This is not a perminent addition to the game, but rather a fun-intro event for subpaths.\r\rA couple things to note:\r\r1.) The stones will not be around to stay forever, after the event they will disappear, but the items they make will stay.\r\r2.) Any quests the stones will be used for will not stay around, so the resulting reward will be a rare item, similar to events in nexustk.\r\r3.) Have fun, as this is just the beginning, perhaps things may just get more involved ;)\r\rAugust',48),(1102,290,'Mina',1,0,8,4,'Subpath Bugs 8/4/15','Subpath Spell Bugs\r\rSHADOW\r*When learning \'Throw Dagger\', part of the dialogues and action boxes think you are learning \'Fate\'s Flame\'.\r\r*\'Shadow Self\' only has a spell description of \'Summon\'.\r\r*\'Shadow Self\' monsters are subject to the caster\'s traps and Serpent Strike - meaning the Shadow is killing his own \'aid\'. The Shadow Selves are also not being created to look exactly like the caster. (IE: one person\'s was created as a newbie girl, all naked.)\r\r*\'Throw Dagger\' - what was your intent on this spell? Damage? Just a way to aggro a monster?\r\r\rARCHER\r*The Compound Bow needs a damage increase by 10m10 on Small and Large.\r\r*The Compound Now needs a increase of durability to 150,000.\r\r*The Traitor\'s Bow needs a damage increase by 10m10 on Small and Large.\r\r*Fix equipment stats on all bows. Currently says \'Rogue\' level 0. Should be \'Archer\' (if possible) with appropriate level.\r\r*Enchanted Ammo (Fire) - Damage appears to be fixed at 144 damage. Please increase or make a % of health/vita.\r\r*Volley - Damage appears to be fixed at 1290. Damage is unaffected by invisible. Please increase.\r\r*Archer spells can be used without a bow equiped.\r\r*Barrage increases attack speed with all weapons.\r\r*Enchanted Ammo - Enchants non-bow weapon.\r\r*Arrow attacks sometimes only hit the first target, or the one behind it. Damage is split between multiple enemies like previously with Warrior\'s Flank.\r\rArcher Circle has blocked tiles that need to be remedied:\rTile Issue - 5,9 - Should not be blocked.\rTile Issue - 17,11 - Should not be blocked.\rTile Issue - 14,18 - Should not be blocked.\rTile issue - 15,18 - Should not be blocked.\rTile Issue - 0,15 - Should not be blocked.\r\rBARD\r*General complaints about aethers.\r\r*The Bard SC(and Mez) spell shouldn\'t do full room SC, but a pulseable SC that does 2-4 SC every 4 seconds as long as the spell it active on the Bard. (It lasts... let\'s say 60 seconds.) Only the SC or Mez spell can be active on the Bard at any given time.\r\rKNIGHT\r*Blade\'s Judgement and Deflect does not work in PVP even if used on a monster. Works fine once PVP is turned off. Should be fixed so that it can only be used in PVP on monsters, or never useable on humans.\r\rGLADIATOR\r*Intervene doesn\'t seem appropriate for the role-play of a Gladiator. Seems to be more appropriate for a Knight who is dedicated to helping people. Perhaps remove Intervene and offer it to the Knights when we allow new spell requests - and given Gladiators an ability that increases their armor (making them weaker) but gives them a damage boost?\r',53),(1138,290,'Mina',1,0,8,5,'Subpath Bugs 8/5/15','*Some subpaths can supposedly see their subpath board on \'b\'. Please review and make it so that no subpath can see their board on \'b\'.\r\r\rDruid\r*Complaints regarding Ent aethers.\r\r*Tree outside of circle is in permadeath - needs to be removed due to the change of \r\rwalker/guide addition to path.\r\r\rElementalist\rFire Emanation - Can cast vita attacks on it - resulting in lost of health of caster, but no damange to Emanation.',54),(1181,2,'August',1,0,8,6,'Crash 8/6 6:11PM CST','\r\rMy fault. I apologize. Working on some code.',49),(1364,2,'August',1,0,8,12,'Reset 8/12','\rMinor Reset\r\rFixed issues with event items showing up in bank as ??\r\rAugust',50),(1410,2,'August',1,1,8,13,'Additions Log / Fix Log','\rThe following adjustments have been made:\r\rRogue no longer has the spell haste. In place of haste is a new ability called Disorienting Dagger. This ability will hit a target up to 4 tiles in front of a player causing effects for both monsters and players in pvp.\r\rMage has had their omniblast changed to help provide them with more mana. This important change allows mage to keep pace with other players in pvp and while hunting/soloing.\r\rPVP has had the Battle Resilience buff added. Ongoing testing will continue with this buff, currently this adjustment sits at %40 reduction and produced excellent results. You can test this now by using two additional options on the npc in the arena.\r\rOther small fixes and bugs were addressed while testing occured. \r\rYou can no longer cast spells on special summons (IE: Druid\'s Ent, Elementalist Constructs, and Shadow\'s Duplicate).\r\rAugust',51),(1531,2,'August',1,0,8,16,'Fixes & Updates 8/16','\rClan banks have been adjusted and are currently active, Demil and the Imperial Legion please test your clan bank and let me know if you come across any issues. Please document exactly what steps were taken to discover an issue. This is important to test for the adding of addtional clans in the future.\r\rThe very annoying AFK zzz emote has been changed to always be the Zzz bubble effect. No more annoying sounds of sleeping.\r\rAddtional bug fixes are in place and adjustments for Carnage system. Please let me know if you notice any bugs!\r\rAugust',52),(1568,2,'August',1,0,8,20,'Stat NPC & Crashes','\rThe stat seller NPC is being worked on. There will be potential crashes occuring.\r\rComplaints will not help.\r\rThank you.\r\rAugust',53),(1581,2,'Francois',1,0,8,20,'The Underwater Caverns! (A NEW cave!)','                   Greetings people of Han!\r\r\r   As Han continues to harbor new adventurers, the discovery\r of new caves become inevitable. We have seen the rise of\r Han\'s Imperial Legion, and now we have even more exciting\r news to share with you all! Two new caves have been\r discovered! \r \r<B>             -------------------------------------\r<B>                   * The Underwater Caverns *\r<B>             -------------------------------------\r\r   Deep within the halls of the Sinking Maiden lie many\r untold secrets. Many wonder how the ship stays afloat, even\r with a massive hole punctured in the side of the ship! Some\r say that it\'s the workings of the undead pirates, others say \r that it\'s from the magics of the Sea! Rumor has it that if\r you travel deep enough within the Sinking Maiden, you will\r eventually stumble across a mysterious underwater realm\r where jewels of every color reside! From Sapphire gardens,\r to Ruby flats, the Underwater Caverns is waiting for you\r to discover its secrets now! Heed my caution, comrade,\r for these foes are a force to be reckoned with! Once you\r have obtained the 99th insight, venture into the deep and\r explore these watery caverns!\r\r\r<B>              ------------------------------------\r<B>                    * The Decaying Kitchen *\r<B>              ------------------------------------\r\r\r    As the discovery of the Underwater Caverns has been\r made, a very large, robust chef has appeared within the\r decaying kitchen, offering aid to adventurers in return\r for their pirate tokens! Please visit the kitchen immediate-\r ly and seek this chef out!\r\r\r-Francois\r\r((Please enjoy this content! If you find any bugs, please utilize our bug board immediately! If you find multiple minor bugs [ex: tile bugs], please make a masterpost for our bug board. If you feel that the bug is of grave importance, please use /report or whisper/mail a GM! Thank you for your continued support during our Alpha phase of the game!))',54),(1582,2,'August',1,1,8,20,'Pristine Echos (Exp Selling)','\rWe have activated the feature to increase your stats through selling of experience. This feature is located in a new building in Han (Pristine Echos), explore and you will notice slight changes and the new location.\r\rStat selling is currently capped. It will remain capped as we test functions and continue work on the server. Please report any bugs related to this IMMEDIATELY.\r\rShould anyone abuse this feature, there will be resets and rollbacks for individuals. Please respect the hard work that goes into the code and development of content and report bugs/issues.\r\rThanks, and enjoy!\rAugust',55),(