ing Stone\r\rKingdom Wall(ICoH-76,12)\rHobgoblin Mender: 175000\rHobgoblin Rampager: 175000\rHobgoblin Firestarter: 175000\rHobgoblin Sneak: 175000\rAll Drop: Hobgoblin Goo\rChutac Kikini(Boss:) 350000\rDrops: Echoing Staff/Hobgoblin Shank\r \rOgre(KP-35,01)\rReckless Ogre: 193800\rMenacing Ogre: 199900\rBeserk Ogre: 206000\rAll drop: Amber/Sturdy Chest Key\rGrukor(Boss): 412000\rDrops: Ogre-Horned Helm\rGuiruk(Boss): 412000\rDrops:Ogre\'s Spiked Club',3),(1732,4,'Dhaism',0,0,5,6,'Droplet king quest','if you talk to the npc again before slaying the droplet king in the tutorial he says\r\r\"you still have yet to slay the droplet king it appears\"\r\rshould read something like\r\r\"you still have yet to slay the droplet king when it appears\"',5),(1740,4,'August',1,1,5,8,'Re: Reia','Bank bug fixed, thanks!',11),(1746,4,'Metsu',0,0,5,10,'Aegis Sancta (Timers)','Depending on the time of the main spell, when it recasts both Aegis and Sancta. The aehters on those two spells is the same as Aegis Sancta.\r\r\rExample: Aegis Sancta has 52s left.\r\rAegis II and Sancta II run out and once refreshed by (Aegis Sancta) they both only have 52s. Instead of having the full time as if you were casting them on your own.\r\r\rDont know if this was intended but from the last server I remember it not happening. Its not game breaking or anything, just noticed it while hunting and confused me why it worked that way.',15),(1748,2,'August',1,1,5,11,'Provider Scheduled Maintenance','\rHello everyone,\r\rI just wanted to post a notice that our server provider will be having a scheduled maintenance at the following time:\r\rStart: 2016-05-18 04:00 UTC\rEnd: 2016-05-18 04:30 UTC\r\rWe will lose ability to connect around this time.\r\rThanks!\r\rAugust',61),(1752,1,'Haschel',0,0,5,11,'Subpaths','Most of the NPC locations are exactly where you\'d expect them to be, based on the names of each path. Most of the quests are pretty straight forward. (Bards like plays, Druids live in wild, etc...)\r\rSome of the tasks will take you to an area you likely haven\'t seen. If you find yourself stuck, try going North.\r\r',4),(1753,112,'Metsu',0,0,5,11,'Woo!','First?',1),(1754,200,'Adventurer',1,0,5,11,'*Etched carvings*','\r *The stone tablet seems crumbled from the natural elements,\r   but as you peer closer, you observe the markings with great\r    detail to realize that it is in fact a journal.*\r\r\r\r \r                     Asako 9, Spring\r\r   Great, just what I needed. After battling my way through\r vicious monkies and tribesmen, the bridge up ahead has been\r destroyed by a landslide! The only way I could possibly get\r across is if I were to dive into the rushing gorge below,\r but I would drown before I made it across! By the light of\r Empress Asako, guide me in this trying times! \r\r   I knew that I shouldn\'t have paid that wretched drunkard\r at the Han Inn for this information, he led me straight\r towards a dead end. Perhaps if I look around, I might find\r something of use to craft a breathing device! \r\r\r                     Asako 9, Spring\r  \r   An older gentleman who lives not too far away has given me\r hope! He claims that the flowers he grows in his garden holds\r miraculous properties to breathe underwater! I cannot consume\r these flowers however, they must be crafted into something\r that would last much longer. Perhaps a mask? He handed me\r a dozen of these flowers for a fair price! I think I\'ll \r need double that though in order to craft the mask.\r\r   Hm.. With a few pieces of Elm Branch and a couple clumps of\r wool, I should be able to fasten everything together. But\r something is still missing. Something that holds a great\r amount of energy to sustain the mask for a bit of time. Ah,\r a Coral ring will do perfectly!\r\r\r                     Asako 9, Spring\r\r   The mask is complete! Now, this isn\'t the sturdiest of\r masks, so I don\'t think it\'ll last very long. Probably just\r enough time to be able to travel across, or maybe go for a\r leisurely swim at midnight. Perhaps I will finally be able to\r find out if the rumors of great treasures are true! I hear\r there is a goldmine\'s worth of treasure waiting to be disc-\r overed in that Ancient Ruin just up ahead!\r\r-Adventurer',1),(1755,112,'Delkar',0,0,5,11,'Metsu','I\'ll let you have this one.',2),(1759,2,'August',1,0,5,13,'Druid Changes','\rHello Druids,\r\rJust a quick change I wanted to detail. The Ent\'s behavior has been modified with new code and the click menu is no more.\r\rYour Ent is now smarter and stronger--he now uses his special attack on his own and as a taunt every 10 or so seconds instead of a minute.\r\rHis targeting is improved and he of course scales with enspirit.\r\rLet me know if you come into any issues. Remember to summon him after you have used enspirit to get the affects of this boost to power.\r\rAugust',63),(1760,4,'August',1,1,5,13,'Re: Yi Bok Yen Village','\r\rMy appologies!\r\rFixed\r\rAugust',21),(1761,107,'Warrior',0,0,5,13,'First!','I lifted my sword, and there was death.',1),(1762,113,'Dhaism',0,0,5,13,'Friday','Friday, gotta get down on friday.',1),(1763,4,'Dhaism',0,0,5,13,'65 poet armor quest','if you start the quest with a full inventory the npc will give you the dull stone which will fall to the ground instead of telling you that your bag is full.  I didnt test it, but i assume if someone else picks it up they would be stuck with it since you cannot drop it.\r\r\rAlso can we get a suggestions board to make suggestions?',22),(1764,1,'Kettu',0,0,5,13,'Basic tools','Anyone in need of a new tool for their crafting professions can contact me or Metsu. I\'ll help you out.',5),(1771,2,'Cosmos',1,0,5,14,':: Recent Additions','\r : Additions :\r -------------\r\r * Subpaths added; visit your Guildmaster after Lv50.\r\r * Gathering skills added:\r   - Mining   :: Tin > Copper > (COMING SOON)\r   - Forestry :: Elm > Birch > Maple > Cherry > Oak.\r   - Shearing :: Wool > Merino > Angora > Cashmere > Silk.\r\r * Crafting skills added:\r   - Smithing, refine & manufacture ores/metal.\r   - Carpentry, refine & manufacture branches/wood. \r   - Tailoring, refine & manufacture fibres/cloth.\r',64),(1773,108,'Calihye',0,0,5,14,'The shadows rise up','\r\r\rAnd are reborn on a new star...\r          ...but did they ever truly vanish?\r\r\r\r\r\r\r\r\r\r\r-Calihye',1),(1776,4,'Cosmos',1,1,5,14,'Re: Reia & Kettu','\r  ** Pop-up issue resolved with crafting machines.\r\r  ** Bug with Apt. V not producing materials, fixed.',26),(1777,4,'Percivale',0,0,5,15,'Battle stance & Flame Guard II','\r\r\rI\'ve noticed that when I switch weapons and have this cast it will say your weapon is no longer enchanted, or something along those lines...but the spell does not vanish.\r\rso when I re-equipt and the spell is cast, not sure if I get the benefit of the spell again.\r\r\r\r//\r\r\rFlame Guard II on my mage, randomly does not have mana to cast even though it\'s full. Has happened since I got the spell, and shakily worked even as I gained more base mana. First iteration of the spell did not do this.',27),(1778,4,'August',1,1,5,15,'Re: Percivale','\r\rThe status message for Precision/Fighter\'s stance deals with enchants. Weapon enchants are made to work here even when your weapon is replaced. I can change the message to not print--there is also an option for enchants to fall off if weapons are removed but that just seems silly.\r\rAs far as Flameguard goes--what I can tell just by the bug report is that you aren\'t casting either Blizzard or Molten Blast.\r\rThe more and more you cast Flame Guard without casting other offensive spells (targeted strikes), the more mana it consumes.\r\rAt one point you wont be able to cast Flame guard because it costs too much mana. This increase is intended to prevent auto-hunting. I can change Flameguard\'s learn desciption to include this notice.\r\rThanks for reporting bugs, we need to know these things to fix and adjust content ;)\r\rAugust',28),(1779,4,'Reia',0,0,5,15,'Smithing Products flipped','\r Aptitude VI option \'Iron sword\' creates \'Dull iron sword\'\r\r Aptitude V option \'Dull iron sword\' creates \'Iron sword\'\r\r Essentially they are just mismatched it seems.\r\r',29),(1780,2,'Cosmos',1,0,5,16,':: More Additions?!','\r  ** Quests for gatherers added at Aptitude VI.\r  Visit their corresponding crafting teacher for more\r  information or to start the quest.\r\r     Miners -> Smith NPC.\r     Shearers -> Tailor NPC.\r     Foresters -> Carpentry NPC.\r\r\r  ** Coats and other goodies added into crafting system.\r  Be sure to go back and check your old Aptitude levels\r  incase something was added!',65),(1781,4,'Cosmos',1,1,5,16,'Re: Reia','\r  Thank you. The error has been fixed.\r\r  Dull Iron Sword, should make Dull Iron Sword now..\r  Iron Sword, should make Iron sword now..',30),(1783,4,'Winsilbert',0,0,5,18,'Reanimated Sorceress MQ','The minor quest does not display the correct image for the Reanimated Sorceress.',31),(1784,4,'Cosmos',1,1,5,18,'Re: Graphic + MQ Timer','\r  Timer has been adjusted as with Graphic will be looked\r  into. Thank you for finding all of these bugs and\r  pointing them out to us! <3',32),(1787,110,'Sgrios',0,0,5,19,'Purse first, bitches',':)',1),(1788,107,'FeMa',0,0,5,19,'Rawr','\r      Smashing',2),(1790,9,'August',1,0,5,19,'- Hunting Grounds','<B>Location Key: \r   DNW - Dor Nalan Wilds (East of ICoH)\r   SLL - Seong Lowlands (West of ICoH)\r  ICoH - Imperial City of Han\r   VF  - Vogh Forest (South of ICoH)\r   KP  - Kalbog Pass (East of ICoH then North immediately)\r\r<b>    Level  | Cave Name              (Location - XXX,YYY)\r<b>  ---------+-----------------------------------------------\r    8 - 15 | Crystal Fox Cave    (   ICoH - 077,024)    \r   15 - 20 | Han Sewer Cave      (   ICoH - 009,062)    \r   20 - 25 | Stone Voodoo Dolls  (   DNW  - 028,062)\r   25 - 31 | Hive                (   DNW  - 099,051) \r   31 - 37 | Poring Paradise     (   SLL  - 053,058)  \r   37 - 43 | Mud Boars           (   DNW  - 063,038)\r   43 - 50 | Kalbog Fae          (DNW->KP - 043,040)\r   50 - 55 | Haunted Valley      (   SLL  - 066,012) \r   55 - 62 | Tanzar Walls        (   SLL  - 044,066)\r   62 - 67 | Serpent\'s Slither   (   VF   - 057,037)\r   67 - 73 | Florandine          (   VF   - 079,024)\r   73 - 79 | Du Jan Volcano      (   KP   - 001,008)\r   79 - 85 | Dor Sun Tower       (   DNW  - 036,012)\r   85 - 91 | North Empire Wall   (   ICoH - 085,012)\r   91 - 95 | Ogre                (   KP   - 035,001)\r   95 - 99 | Halvung Pirates     (   SLL  - 065,071)\r  25k/12.5k| Ancient Ruins       (South of Halvung?)',1),(1791,2,'Eywa',1,0,5,19,'The Ancient Ruins! (A NEW cave!)','\r                   Greetings people of Han!\r\r\r   After Tsugua was vanquished by Empress Asako, the towns-\r folk of Han gathered together in jubilant cheer, but no\r matter how much the sun peaked over the horizon, the \r aftermath of the dark sorcerer\'s waste lay heavy scars and\r burdens onto our brave fighters. Many retreated to the Han\r Inn, turning into drunkards to cope with their ordeals. A\r particular adventurer paid good coin, still ablaze in\r determination to discover more riches of the lands. \r\r   She was tipped off by a drunkard, leading her to travel\r across the vast waters and journey through the southern part\r of the Halvung shore.\r\r<B>                 ----------------------------\r<B>                     * The Ancient Ruins *\r<B>                 ----------------------------\r\r   Take arms, people of Han! A band of Voodoo tribesmen\r have gathered south to the Halvung shore! Even the wildlife\r has turned hostile! The Ancient Ruins have been hidden from\r the Empire of Han for years, rumored to have been wiped \r away after Tsugua\'s dark reign! Talk has started to surface\r among the townspeople, claiming that an ancestral tomb rests\r peacefully within the foliage! \r\r   The tomb served as a resting place for ancient roalty, \r where kings would be able to roam peacefully in their final\r resting domain, but beware, the tribesmen who still inhabit\r the Ancient Ruins will ruthelessly protect the tomb with\r their life! Vast treasures await those who are brave enough\r to venture in! Gather your allies and head out! \r\r-Eywa\r\r((Please enjoy this content! If you find any bugs, please utilize our bug board immediately! If you find multiple minor bugs [ex: tile bugs], please make a masterpost for our bug board. If you feel that the bug is of grave importance, please use /report or whisper/mail a GM! Thank you for your continued support during our Alpha phase of the game!))\r\r((PS: A certain stat requirement must be met in order to\r      enter. Good luck and happy hunting!))\r',66),(1792,2,'August',1,1,5,19,'Announcement: Beta Approaching!','Hey everyone!\r\rI wanted to give you all a sneak peek into the upcoming content that will be released soon. The GM team has been hard at work programming future content, fixing bugs, and mapping out new locations to visit.\r\rThe following are plans we\'ve made for the scaling of 99 up to First Mark:\r\r  Level / Stats --- Cave\r -------------------------------------\r      Lv 99        Underwater Expanse\r    25k / 12.5k     Ancient Ruins\r    50k / 25k       The Frozen Hold\r    75k / 37.5k     The Lost Library\r   100k / 50k       Sky Palace\r\rMaps, enemies, special programming, and new item/reward systems have been completed and implemented. Areas may be added or moved around, but this is our current outlook.\r\rExpect awesome new Boss AI, as well as dungeon mechanics that require smart playing, teamwork, and skill. These mechanics make for a more involved and engaging gaming experience.\r\rSubpaths, as you could see, have the new quest admission system. Rolling out soon will be the special subpath-specific quests, that will allow a path member to acquire the same weapons and armors that the path representatives can be seen wearing.\r\rTesting the gathering (Mining, Shearing, and Forestry) and manufacturing  (Smithing, Tailoring, and Carpentry) crafts are still going on. New rewards await those who are skilled enough to learn their secrets. Additional crafts; Alchemy and Jewel crafting, are still under-development.\r\rUltimately once these tasks get closer to release we will be phasing into Beta with no data-wipe. Repeat ** NO DATA-WIPE**. The feedback provided by our current tester-players has been astounding! The more bugs we can address, the better experience for everyone! So thank you everyone who has helped us thus far, and continues to do so.\r\rAs always, let us know what you think and if you have questions!\r\r  -The Han GM Team\r  Signed August, Cosmos & Eywa.\r',67),(1794,4,'Sgrios',0,0,5,20,'Depositing.','\r\rLevel 50 haunt house weapons shouldn\'t cost 5,000 coins to deposit, imho 500c-1k to deposit at most.\r\rAlso, bank isn\'t alphabetically ordered. Just a suggestion! ',33),(1795,4,'Sgrios',0,0,5,20,'Palace Gardens weather','\r\rIt\'s raining in the palace gardens. intentional?',34),(1796,4,'Sgrios',0,0,5,20,'Palace Gardens quest exp/items.','\r\r It should probably offer anywhere from 2-5m experience as a reward. 100k is not worth it, especially at this level where my tnl is 10-14m in the high 60s, low 70s. \r\r Also, bulbs hold in a max of 40 whereas the leafs you can hold hundreds of in stacks of 100 each, multiple stacks. up it a lil bit perhaps? I left a lot of bulbs behind in my hunt.\r\r-Sgrios',35),(1797,4,'Sgrios',0,0,5,20,'Cant use mount in kalbog pass','\r\r Despite it not being a hunting area, cant mount here.\r',36),(1798,4,'Winsilbert',0,0,5,20,'Warrior NPC','When reaching level 50 and speaking with the NPC in the Warrior Temple, the NPC now has a new option that talks about Warrior Subpaths.  There is a blank space between this option and the 3 options that previously existed.  The NPC menu looks like this:\r\r\r\rMinor Quest\rLearn Spell\rForget Spell\r\rWarrior Subpaths',37),(1799,4,'Haschel',0,0,5,20,'Bonded Rings no longer work','Anywhere, even in town, on the same map. Perhaps they were taken out intentionally. That would be disappointing.',38),(1800,4,'CalRipkinJrBaby',0,0,5,20,'Mouse Movement very laggy','I tried running as administrator and in compatibility mode for XP SP3, but neither seemed to help.  Is there anyone who\'s managed to fix this issue?  Windows 10 64bit here.',39),(1801,4,'Ryoga',0,0,5,20,'RE: Mouse Movement','Try Compatibility mode with Windows 7, and turn on reduced color mode 16bit',40),(1803,4,'Winsilbert',0,0,5,21,'Emerald King','I\'m not sure if this is a bug or intended, but thought I\'d mention it.  Emerald Kings (the big green boss tiger in the tiger cave) has a chance to drop multiple hand items at once.',42),(1804,4,'Brancrese',0,0,5,21,'Repair Costs - Warriors','Need to be tweaked a bit, they take a beating. Soloing in pirate, I\'m barely able to cover repairs from the drops of Calc masses/Rotting flesh. That\'s with taking all the drops, if I was grouped and had to split, I\'d like be taking a loss.\r\r**Repost/Update**\r\rThe main issue is in the sub-accesory items from Ogre. On my last repair, the total cost was 32264, 23931 of this was for Steel Bracelet.\r\rThis really needs to be addressed, as a warrior is barely able to break even, given the amount of hits Warriors takes, at this current rate. If drops were split with a group, there\'s no chance a Warrior could keep repairing, and would eventually be broke. I\'m basically forced to farm on another character, just to afford to keep hunting on my Warrior. Not good.',43),(1805,4,'Brancrese',0,0,5,21,'Shield Durability','Could use a tweak, at 10k dura, the shield doesn\'t hold up for more than about an hour of huntin, if that.\r\r',44),(1806,4,'Haschel',0,0,5,21,'Underwater Cave Boss','Gives same exp as a regular mob, 400k.',45),(1807,4,'Cosmos',1,1,5,21,'Re: Winsilbert (#37)','\r  The blank space is suppose to be there on purpose, to\r  help seperate the menu options and clearly see the new\r  quest offered.',46),(1809,4,'Cosmos',1,1,5,21,'Re: Win10/Mouse Lag','\r  I myself, am using Win10 (64 bit). The settings I use are\r  as follows:\r\r\r  COMPATIBILITY\r  - Run this program compatability mode for Win 7.\r  - Reduce color mode, 16-bit (65536) color.\r  - Disable display scaling on high DPI settings.\r  - Run this program as an administrator.',48),(1810,4,'Reia',0,0,5,21,'Re:Cosmos/Ryoga- Ty! + warrior swing','What Cosmos said, I did for windows 8 system.\r          \r         (only difference is I did not Disable scaling)\r\r  Ive been playing with mouse like that since I don\'t know\r when, and it bothered me. Thank you two.\r\r---------------------------------------\r\r   So for warriors, I noticed that the creature in front of\r  you takes less damage per hit? Is this intended.\r\r   For instance... you are X              A\r     and facing south(down).                                    \r                                       B  X  C\r                                      \r                                          D\r\r  So as I witnessed on my warrior, in flora, all the same\r type of monster, yet the one which you face takes slightly\r less damage when swinging. I believe it was about 393 avg\r per hit to the one in front and 456ish to the ones flank\r and behind. \r\r   ',49),(1811,2,'Cosmos',1,0,5,22,'Monster :: Vita & XP Changes','To accomidate easier leveling and a more fluid progression, all hunting caverns have had their monsters adjusted in both vitality and experience given. Get out there and test them out!',68),(1813,4,'Cosmos',1,1,5,22,'Re: #35 and #45','\r  Both the Underwater boss, and the Palace Gardener Quest\r  have had their experience revised and fixed.',50),(1815,1,'Reia',0,0,5,23,'Subpath NPC Locations (Rough Draft)','.Archer, Yogt Forest (Upper western most portion)\r.Shadow, Imperial City of Han (Outside South Shaman)\r\r\r,Elementalist, North of Pinyan Village (North of Witch area)\r,Seer, inside Palace inside one of the doors on the right\r      side on the first floor.\r\r\'Bard, Theatre to the right of Palace south gate Han. \r\'Druid, Dor Nalan Wilds top middle of map, outside of house.\r\r;Gladiator, Arena in Han City to the right of north gate.\r;Knight, Han City, between Theatre and Palace.\r\r  (will update for more detailed, specific infos/coords)',6),(1820,4,'Brancrese',0,0,5,23,'Sell price of items','Sale prices need to be looked at at some point.\r\r99 Cave items are selling for next to nothing:\r\rJellyfish slime = 40 gold per piece\rRaw Shrimp meat = 35 gold per piece\rVoodoo Charm = 10 gold per piece\r\rPirate is slightly better, but still under low level caves:\rRotten flesh = 100 gold per piece\rCalcified Mass = 100 gold per piece\r\rBottled Wind  = 275 per piece\rFloral Bulb = 250 per piece\r\rI didn\'t check all the rest, but shouldn\'t items in higher level caves be worth more?',53),(1823,4,'Brancrese',0,0,5,24,'Palace Garden Quest','When turning in 20 Floral Bulbs, the pop-up window states you receive 2.5million experience.\r\rThe status window however shows 2 million. In testing, it appears you do actually get 2.5, so just the status message is wrong.',55),(1825,4,'Cosmos',1,1,5,24,'Re: Brancrese (#55)','\r  Thank you, the exp and status message match now.\r  Both set at 2,500,000. <3',56),(1826,4,'August',1,1,5,24,'Re: Reia Direct Damage','\r\rAny monsters that you are directly attacking head on that are facing you will take reduced damage. This is why abilities that turn the monsters back towards you will be valuable, because hitting a monster in the back increases damage.\r\rAugust',57),(1827,4,'August',1,1,5,24,'Re: Haschel Bonded Rings','\rFixed, broken due to stat cave changes.\r\rLet me know if there are any other bugs/issues with them.\r\rAugust',58),(1828,4,'Cosmos',1,1,5,24,'Re: #33/#43/44','\r  All items have had their deposit fee\'s, repair costs and\r  durability re-evaluated.',59),(1829,109,'Reia',0,0,5,24,'Ohay~','\r\r       Hi there Archers.\r',1),(1830,1,'Reia',0,0,5,24,'Warrior Shields','\r     Can be created through crafting. If you need one,\r  send me a mail and I can parcel you one through the\r  messanger. No charge, the durability has been updated,\r  though if you require a replacement- contact me as well.\r\r             Requires Level 30, and Warrior only\r             \r\r   Reia',7),(1831,2,'August',1,0,5,25,'Shadow Changes','\r\rI wanted to post a quick update to the Shadow subpath.\r\rTo help balance Shadows with the damage output of Archers the Shadowshift ability has changed. This ability now has two uses.\r\rShadowshift can still be cast on a group member to swap positions, but now in addition when cast upon yourself Shadowshift will cause a burst of shadow damage traveling outward from the player\'s position.\r\rThis ability is similar to that of Volley in damage output, with slightly different mechanics.\r\rPlease test out the spell and let us know if you find any bugs.\r\rThanks!\r\rAugust',69),(1832,4,'Brancrese',0,0,5,25,'Stone Plate Durability','Is set at 90k, not sure if this is intended or not, just seems an odd number for an armor, given that rings/helms are at 150k now.',60),(1834,4,'Cosmos',1,1,5,25,'Re: Dura (#60)','\r<b>  That was intentional.\r  It\'s also to accomidate repair and deposit fees.\r\r  A reminder; that is only a Lv65 Armor.',62),(1835,4,'Cosmos',1,1,5,25,'Re: Sell Price (#53)','\r  Sale price of items has been scaled from Crystal Fox\r  up until Jungle Temple. Sale price is now dependant\r  on quantity/drop rate of the item for that cave,\r  scaling up as caves progress.',63),(1836,4,'Sgrios',0,0,5,25,'Elemental Amplification','\r\r\r The spell allows omnistrike to become a 5 way for a short\r duration of time, but you cannot 5 way cast on yourself to \r kill the monsters around you. This needs to be tweaked so\r that it allows this.\r\r',64),(1837,4,'Haschel',0,0,5,25,'Crafting skill ups','I\'m quite sure it\'s on your list, but just putting it here for posterity.\r\rSkill increases for crafted items are currently not worthwhile for higher cost items.\r\rIn example:\r\rDull Pickaxe (Apt 1) received 2% toward next Aptitude and costs 2 elm planks\r\rBasic Pickaxe (Apt 3) received 1% toward next Aptitude, and costs 2 elm planks, and 2 birch planks\r\rPlenty of other examples of this in other crafts too (tin wire vs armors, etc...) more difficult, costly items, shouldn\'t provide less skill than cheaper, lower difficulty ones.',65),(1838,4,'Cosmos',1,1,5,25,'Re: Haschel (#65)','\r    Skill-up has been revised, based on the Apt you are \r    crafting from you receive a minor bonus depending on\r    the type of item you are making.',66),(1839,4,'Metsu',0,0,5,27,'The Silk Forest Door','The door to go back out of the silk forest is blocked and you cant exit the map.',67),(1840,4,'August',1,1,5,27,'Re: Silk Forest','\rFixed',68),(1843,4,'Elix',0,0,5,29,'Elemental Emanation','The totems themselves seem to be working just fine. The system is intuitive and makes sense.\r\rMy only problem is the costs across the board.\r\rThe totems themselves consume far to much mana, and the cost to regen it is steep. Coupled with the low duration of the spell makes it feel alittle \"clunky\". Now I\'m not certain if being 99 will help with these mana costs. But at the level you obtain it, it makes for a strange dynamic.\r\rBut I do understand if the purpose is to avoid afk totem jockys.\r\rIts more of a consideration, but further testing will be done and I\'ll report back about how the dynamics change at later levels.',69),(1844,4,'Forrest',0,0,5,29,'Tailoring Bugs','I\'m Apt II Tailoring and I can\'t craft Weak thread successfully. Been stuck at 97% to Apt II for 2 days now with 60 more wool clothes wasted on trying it.\r\rCan you check whether there\'s a bug in tailoring?\r\rThank you.',70),(1845,1,'Dekthro',0,0,5,29,'Choosing subpaths?','I\'m not 50 yet so I can\'t decide, but is there anything other to go on for which subpath to choose, besides the two pages of dialogue they provide? Such as spells they get, items, etc.',8),(1846,112,'Banana',0,0,5,29,'Good morning!','Allo!',3),(1847,4,'Okoyu',0,0,5,29,'Shadowshift kills not giving experience.','Yes.',71),(1848,4,'Okoyu',0,0,5,29,'Hyun moo totem time','gives no experience bonus.  Chung ryong and Ju jak both give a 10% boost during their respective times. Can\'t speak for Baekho.',72),(1849,4,'Eywa',1,1,5,29,'RE: Elix - Elemental Emanation','\r\r Yes, being 99 helps with the cost of the totems when you cast totem regen/refresh.\r\r Another thing is that at level 90, you will learn Omniblast, which serves as a damage output spell while restoring 90% of your mana as well, with relatively short aethers, so you will be able to properly keep your totem up no problem - just the annoying part is keeping the totems hp and mp up.\r\r-Eywa',73),(1850,4,'Banana',0,0,5,29,'Poet Quake Spell','Just a visual actually.\r\rQuake animation is black lightning.\r\rI thought that was on purpose\r\rBut quake 2 is actually a quale animation.\r\rI assume now they are both supposed to be actual \"Quakes\" \r\rJust letting you know!',74),(1851,4,'Cosmos',1,1,5,29,'Re: Tailoring (#70)','\r  Issue should be resolved now.',75),(1852,4,'Reia',0,0,5,29,'Mining Numbers:',' At Aptitude 6, going on 7\r\r Takes 15min to get 2%\r                       (1hr = 8%)\r\r So to get the 61% I need for Apt 7 would take me roughly\rover seven hours of strictly mining.\r\r Is it intended to take this long, is my only question?\r\r Thank you for taking a look at this.',76),(1854,1,'Reia',0,0,5,29,'Re: Choosing Subpaths',' On this subject, usually between the four paths, of the two\rsubpaths associated with each- one is typically support /\rdefensive, and the other is offensive. Ill list below the\rbest I can which fit what catagory for style of play. The\ronly path that both subpaths are offensive is Rogue.\r\r(+) Indicates their dominant quality.\r\rMage-  Elementalist = Offensive(?+), with slight Support\r       Seer         = Support(+) / Healer\r\rPoet-  Druid        = Offensive / Healer, with slight Support\r       Bard         = (Unsure) Healer(+) / Support ?\r<b>         `--> (I\'d imagine this is the main healing class)\r\rWarrior- Knight     = Defensive(+) moderate Support\r         Gladiator  = Offensive, tiny support\r\rRogue- Shadow       = Offensive(+) [Single Target]\r       Archer       = Offensive(+) [Multi Target]\r\rAs for spells, I only really know all of Archer currently.\rI will gather information however on the spells for each\rsubpath. I will say that some of the abilities are amazing,\rand have been balanced extremely well to match eachother.',10),(1855,4,'August',1,1,5,30,'Re: Banana','\r\rQuake I uses a spell animation that is actually supposed to be a crack in the ground that is spreading.\r\rI can see how many people think it looks like black lightning, it further is assisted in this manner by NexusTK which gave it to players and called it a zap/lightning spell.\r\rIt is part of an older set of graphics, so the interpretation of it was a little open.\r\rAugust',77),(1856,4,'Dekthro',0,0,5,30,'Molten Blast II','I understand and appreciate the mechanic of increasing mana to prevent AFK abuse, but I find my self a lot of the time in between recasts frantically trying to spam other spells in order to be able to recast.\r\rI didn\'t experience this with Molten Blast I, so I\'m not sure if that is due to this mechanic not being in place for that spell, or some sort of error/glitch in II.',78),(1857,4,'August',1,1,5,30,'Re: Dekthro','\rThe only increase to mana occurs with Flame Guard, if it is used too often without using a targeted attack like Molten Blast or Blizzard.\r\rAre you saying that Molten Blast II costs too much mana?\r\rAugust',79),(1858,4,'Dekthro',0,0,5,30,'RE: August','Nope, that was a straight up word swap, I ment Flame Guard :B',80),(1859,4,'August',1,1,5,30,'Re: Flameguard','The tiers were:\r\rFlame Guard: 100\r\rFlame Guard II: 1000\r\rFlame Guard III: 1500\r\rFor the initial cost of the spell. If the spell is cast again without casting Molten Blast/Blizzard in between then the cast cost is increased for the next cast by double.\r\rI reduced the tiers to:\r\rFlame Guard: 100\r\rFlame Guard II: 500\r\rFlame Guard III: 1000\r\rShould abuse occur again, the costs will be reverted.\r\rAugust',81),(1860,2,'Eywa',1,1,5,30,'The Frozen Hold (A NEW Cave!)','                   Greetings people of Han!\r\r\r   Brave souls have traveled across the lands in search\r of great treasures, surpassing the strength of many mighty\r foes. As we grow in numbers, we also grow in strength, our\r tactics unmatched by all others. Legends have surfaced \r among the people of the Yi Bok Yen village, a village high\r north, deep within the frozen tundra, that a new threat has\r emerged. Countless brave men and women have traveled deep\r into the mountains to never return. A researcher by the\r name of Gin Dian has issued an alert to everyone around! \r Should you be able to delve deep into the Frozen Hold\r and retrieve any rare artifacts, he may be able to make it\r worth your while. \r\r \r<B>             -------------------------------------\r<B>                   * The Frozen Labyrinth *\r<B>             -------------------------------------\r\r   \r    A dangerous journey awaits all eager adventurers, for the\r Frozen Hold has been discovered! Quickly, comrades! \r Gather your steed and make haste to the north, for the legend\r is true! After Tsugua had pillaged the imperial city of Han,\r many warriors were left wounded. One particular warrior was\r so gravely injured that he saught refuge within the Yi Bok\r Yen village, but it was too late. It is known that the very\r touch of Tsugua could turn a man into stone, but something\r far worse has happened to this poor warrior, for his skin\r had turned pale. Chilled to the bone, the wounded warrior\r went even deeper into the mountains, eventually collapsing\r onto the cold, snowy floor. \r\r   The brave fighter accepted his defeat, but in his finality,\r he was given a rather dark twist of fate. His cold hatred\r incased him completely into a block of ice, eventually \r spreading from the very ground and entombing an entire valley\r into ice! A frozen hold now surrounds this poor soul,\r trapping other brave fighters who dare venture in. Great\r treasure awaits those who are courageous enough!  \r \r   \r\r-Eywa\r\r((Please enjoy this content! If you find any bugs, please utilize our bug board immediately! If you find multiple minor bugs [ex: tile bugs], please make a masterpost for our bug board. If you feel that the bug is of grave importance, please use /report or whisper/mail a GM! Thank you for your continued support during our Alpha phase of the game!))\r\r((PS: A certain stat requirement must be met in order to\r      enter. Good luck and happy hunting!))',70),(1861,2,'Eywa',1,1,5,30,'The Lost Library! (A NEW cave!)','<B>             -------------------------------------\r<B>                      * The Lost Library *\r<B>             -------------------------------------\r\r   Magi have reigned throughout the lands for centuries,\r never wavering from their abundance of knowledge. Han \r has seen many scholars rise and fall in it\'s lifetime,\r but now a strange rumor has begun to spread. Magic has\r been tempted to it\'s utmost limit, to the point where the\r gods had to intervene, placing aetheric energy within the\r atmosphere for mortals to breathe. Rumor has it that a \r scholar had discovered a way around Aether, causing him\r to go absolutely mad!\r\r   This Magi, who\'s name still remains unbeknownst, fled\r from the Royal Scholar\'s library with many valuable scrolls\r and parchments in his possession, casting his wizardry\r knowledge down upon those who dare interfere with his\r diaboloical plan! He fled eastward, beyond the Kalbog\r pass and even beyond the Hive! Many speculate that he\r has discovered a Lost Library of his own, and his manic\r chants can be heard bouncing off of the very Kingdom\r walls to this day! Noble citizens of Han, to arms! This\r Magi must be stopped immediately before the balance is\r thrown into a craze! \r\r   The wicked sorcerer has managed to conjure hundreds of \r mighty wizards and flighters with his magic to protect his\r fortress! You must prove your strength to the gods! \r\r<B>  ---------------------------------------------------------\r\r \r-Eywa\r\r((Please enjoy the new content. As you play, if you find\r  any type of bugs, please utilize our bug board immediately.\r  If you feel that the bug is of grave importance and is\r  possibly game breaking, please alert at GM immediately. If\r  you find multiple bugs [ex: tile bugs where you cannot walk\r  in several places that you should], please create a master\r  post for the bug board instead of multiple posts. Remember\r  that this is Alpha and we appreciate your continued \r  support as we distribute content!))',71),(1862,2,'Eywa',1,0,5,30,'The Han River Market! (Auction house!)','\r\r<B>                   --------------------------\r<B>                      The Han River Market\r<B>                   --------------------------\r\r\rFor decades, Han has served as an empire that has participated in peaceful trade among the kingdoms. With the growth of our civilization, we have witnessed the come and go of many adventurers who have brought various wares to our streams. As the lands continue to be discovered, fortune awaits the bold and trade will only continue to rise.\r\rIn order to further increase sales among the citizens of the empire, Empress Asako has assigned Han our very own auctioneer! Just southwest of the northern gate, a man has set up shop to help the community trade and sell items, along with the chance to redeem tokens for wonderful prizes! \r\r\rIntroducing, The Han River Market! Please enjoy this wonderful addition to the lands as soon as possible! \r\r-Eywa\r\r((August has worked tirelessly to code a fuctioning auction house for the players. Please do enjoy this feature and make sure to test it to the highest limit possible. Finding bugs that involve this newly added feature are CRITICAL, as we do not want to end up having game breaking dupe bugs! If you happen to find any serious bugs, please report them immediately and directly to August or any other GM, you will likely be given a generous reward for your outstanding contribution.))',72),(1863,2,'Eywa',1,0,5,31,'Don your Subpath armor!','\r\r  The lands have constantly shifted as new adventures have \r unraveled for the Empire of Han. With the rise of enemies\r that dwell deep within the confines of various caves, the\r Subpaths have banded together to reinforce weaponry in order\r to combat these tough foes. Once you have obtained the 99th\r insight, speak to your Subpath walker in order to begin a \r quest to obtain a new weapon and overcoat. \r\r   Don your Subpath attire in pride, comrades, for it is only\r you who can stave off the adversaries that lie in the shadows.\r\r\r-Eywa\r\r((If you happen to run into any bugs while encountering these quests, please refer to the bug board and/or report the bug to a GM member immediately.))',73),(1864,4,'Calihye',0,0,5,31,'Shadow self','\r\r\rIt seems that other shadows can control another person shadow self, at least in the way that it mimics emotions. \r\rOkoyu summoned shadow self and any emotion I did, as well as her, appeared on her shadow self.\r\rCalihye',82),(1866,4,'Danica',0,0,5,31,'Poring Paradise','\rIn the blue boss room there is a weird blocked tile that you should be able to move through at 017, 015 and 017, 014.\r\rit\'s next to a door and makes movement a bit encumbered, but perhaps this was intentional?',83),(1867,1,'NinjaXxX',0,0,5,31,'Newbie','Im rogue lvl 43 now.....\rNeed help from another player\rFor weapon \rjust staff dropped from boss\r\rneed senior for helping me cr8 one :D\r',11),(1872,4,'Delkar',0,0,5,31,'Summons fighting after death','With both Shadow Self, and Ent, it is possible for the summon to remain aggroed, and fight after the player dies.\r\rThis allows certain paths to take on a boss they otherwise may be unable to, simply by \"cheesing\" it by running back and re-summoning until the boss dies. While certainly not an easy method, and it\'d take considerable time. This is likely not intended use of the skills.\r\rSummons should probably die when the player does.',86),(1873,4,'Allyeren',0,0,6,1,'WebSite Leaderboards','Currently doesn\'t factor in mana = vita x 2 or stats.\r\r:(',87),(1874,4,'Ezam',0,0,6,1,'Ruins','Mobs spawn in the wall at the bottom around, 40,30.',88),(1875,4,'Brancrese',0,0,6,1,'Jungle Temple','First room of ruins, the following things currently do not work:\r\r- Warrior \"Charge\" spell\r- Bonded rings\r\rMy suspicion is other spells which allow you to jump from one location to another would also have issue. I\'m unsure if there are any other such abilities in game as I don\'t have a character in every path. These are the only two issues I\'ve been able to notice as of now.\r',89),(1877,4,'Haschel',0,0,6,1,'Grouping exp','Currently, with the harsh penalty to exp for grouping, there is little incentive to group, particularly for paths that can solo higher level caves effectively, like Rogues.\r\rWith life drain/echo, I am able to solo in ruins effectively, doing on average 70-80mil per Focus cast. I am also able to solo on my Knight (due to blades judgement) without too much issue, and can do similar exp. Hence, the issue appears to not really be in path balance. \r\rWhen bringing Poet and Warrior, I am barely able to do 50-60mil per Rage cast. \r\rFirst room mobs give 450 and 470k exp. When grouped, it is about 340k. Over 100k difference, this seems a very large number. \r\rI haven\'t tested with larger groups to see if the % loss is the same, it\'s possible this is intended in order to encourage larger groups, where the % loss is lower the more people you add. I\'ll need to check on that. The downside to that is it largely discourages smaller 2-3 groups (which are always easier to find.)\r\rRegardless, I\'m of the opinion that this is a bit harsh of a penalty and encourages solo play rather than grouping.\r\rRespectfully submitted.',90),(1878,4,'Allyeren',0,0,6,1,'RE: 90','I concur. I can pull nearly 80-85m a rage solo as a gladiator with echo.\r\r50-60 with Maze.\r\rand i clear regardless.\r\rthere should be no detriment to grouping',91),(1879,4,'Allyeren',0,0,6,1,'Devastate','Does less damage than Decimate.\r\rTakes me to 10% life.\r\rPlease up damage of Devastate so it\'s useful.',92),(1881,4,'Reia',0,0,6,1,'Celestial Fighter Armors','Seems like crafted armors are missing hit/dam currently?\rFor example, a comparison with same level questable armor.\r\r Breeze Armor Dress      Celestial Armor Dress\r  +7500 Armor             +8500 Armor\r  +1 Hit                  +250 Vita\r  +2 Dam                  +250 Mana\r  +125 Vita               +4 Might\r  +125 Mana               +5 Grace\r  +3 Might\r  +4 Grace               Level 75 Rogue (Fem.)\r\r Level 65 Rogue (Fem.)   \r',94),(1882,4,'August',1,1,6,1,'Re: Brancrese','\rThe reason that ringing, and teleport abilities do not work is because the room is designed in a way that would allow a player to fully circumvent traveling the cave should they teleport up to the top.\r\rWhat I may do is create another work around for that by altering cave design.\r\rFor now it is intended. You will encounter the same restriction in The Frozen Palace due to a quest requiring completion before continuing through the cave.\r\rAugust',95),(1883,4,'NinjaXxX',0,0,6,2,'Where this server from?','This server is great many something new for me.\rJust my ping on this server 400-700 T_T',96),(1884,1,'Eywa',1,1,6,2,'Post 12: Burned.','\rPost contained information regarding a unique part of our cave system that we would like to remain a secret for the other players to enjoy and discover. :]\r\r-Eywa',12),(1885,3,'Eywa',1,1,6,2,'Hunting with programs, afk hunting.','\r   Our server allows for people to use certain 3rd party\r programs and macros without issue, so long as they are not\r game breaking programs.\r\r The following programs are not allowed:\r\r See invisible hack\r speed hacking\r accessible banking anywhere\r etc. (This list is subject to change at any given time.)\r\r\r  You are allowed to use programs to hunt, but we also do not\r fully condone this type of hunting. You must remain vigilant\r while hunting, meaning you are not allowed to go AFK. You\r will be given a warning of one full minute and we will count\r down in front of you if we suspect that you are not at your\r computer.\r\r   If you are caught going AFK, you will be jailed. This is\r at your own risk and we will not compensate for your\r behavior. ',4),(1886,1,'NinjaXxX',0,0,6,2,'Tin ','Need spawn more faster',13),(1887,1,'NinjaXxX',0,0,6,2,'Item inventory','Mining\r\rMax stack 100\rif can make our inven can bring more stack\r',14),(1888,4,'Ezam',0,0,6,2,'Echo Buff','Currently someone can refer their level 1 newbie and receive an echo, and keep the echo buff on 100% of the time.\r\rCombined with the ability to ring to another character this becomes abusive, as that level 1 char is simply an echo bot.\r\rMost people can even hunt in ruins with just an echo and no heals.',97),(1889,4,'Saii',0,0,6,2,'Horses','I think you should be able to use horses anytime you are in an outside area. \r\rMountain pass for example doesn\'t let you mount. Maybe its on purpose to keep you from collecting too much wood or wool? No idea.\r\r\rI also think that if you find a house in nature (brown horses) and you enter a building they shouldnt just vanish. Maybe block entry until you dismount or spawn a new horse outside when you enter. That way if you dont have one to summon you dont have to snails pace everywhere you go.',98),(1890,1,'Cosmos',1,1,6,2,'Re: NinjaXxX (#14)','\r  When you get to a higher aptitude in a gathering skill,\r  you can visiting the gathering skills corresponding\r  crafting NPC for a quest to hold more than one\r  stack at a time..',15),(1891,4,'August',1,1,6,2,'Re: Where is this server from','\r\rServer location is New York. Depending on how far you are and what time of day, latency may differ.\r\rConsidered location of LA as well.',99),(1892,4,'Saii',0,0,6,2,'Branch crate','My crate when taking out branches goes from (II) to 0. Losing 100 branches everytime I use it from V - 0 =[',100),(1893,4,'Cosmos',1,1,6,2,'Re: Saii (#100)','\r  Fixed.',101),(1895,4,'August',1,1,6,2,'Re: Echo','\r\rThe echo buff no longer works on level 99 characters.\r\rIf I see more and more abuse of the echo teleport to lower characters used as just a teleporting post, I may program something in to stop that, as of now I\'m not seeing it too badly. Suggestions welcome.\r\rI\'d hate to ruin the potential for higher players to assist lower players, but if enough abuse happens there may be a level gap restriction placed.\r\rAugust',102),(1896,4,'Saii',0,0,6,2,'Carpenter Apt VII','The only that that I can craft is a longbow?? It that as intended? Or it there a list missing there or something?',103),(1897,1,'jidat',0,0,6,3,'shield for warrior/knight','how i can get shield..\r\rthx',16),(1899,1,'telor',0,0,6,3,'creation system','can some1 give me list/link or anything about creation item in here? and how to get the item pls... im clueless.. LOL\r\rthx',17),(1900,1,'NinjaXxX',0,0,6,4,'How to get an yang token?','Need bloodseeker\rfor my weapon quest',18),(1901,1,'Haschel',0,0,6,4,'re: Ninja','Tokens come from the referal system, when the character you referred reaches 99.\r\rThe Bloodseeker however you can obtain from the Pirate boss.',19),(1902,4,'Etienne',0,0,6,4,'Shadow armor quest.','\rStill shows old graphic armor when you finish the overcoat quest. needs updating :)\r',104),(1903,4,'Sgrios',0,0,6,4,'Elemental spire','Elementalists weapon literally does 0 damage when you swing it at enemies lol. \r\rNot sure if intentional. It would be cool to see if subpaths could undergo a quest to improve their subpath weapon so that they cast spells on targets.\r\rof course, fighter weapons would have to be less % chance while caster weps would be a higher % chance. ',105),(1904,4,'Delkar',0,0,6,5,'Frozen Foothills','Seems to be a dead end, the exit in the top right corner does not go anywhere.',106),(1905,4,'August',1,1,6,5,'Re: Delkar','Tiles fixed.',107),(1906,4,'NinjaXxX',0,0,6,5,'Sub acc bugged','Cant pick 2 item\ri equiped bracelet\rand i got 1 again\rbut i cant pick it\r\r',108),(1908,4,'Delkar',0,0,6,5,'Re: Ninja','Not a bug, they\'re a unique item you can\'t have multiples of, always been that way.',109),(1910,4,'Delkar',0,0,6,5,'Frozen Orbs/Sealed door','I may have missed something, but can\'t seem to figure out anyway to unseal the door in the second room to the left.\r\rI went to the NPC at the study in Yi Bok, bringing him one orb, he tells you to bring back 5 more.\r\rWhen returning with 5, he states \"I see you have the 5 Frozen Orbs. Have you seen the door though? Search for the Door in the frozen palace.\"\r\rI\'ve search all over the palace, nothing seems to trigger. The likely spot would be the blocked door in the room to the left when first entering, but it does nothing.\r\rNeither the main hall in the first room, nor the room to the right seem to have any other type of \"door\" at all.\r\rAm I looking in the wrong place, or is something not working?',110),(1912,4,'Cosmos',1,1,6,6,'Re: Etienne (#104)','\r  The quest has been adjusted to show the current armor.',111),(1913,4,'Cosmos',1,1,6,6,'Re: Delkar (#110)','\r  The issue should be resolved, please try again.',112),(1915,4,'Delkar',0,0,6,6,'Re: Cosmos','Door still doesn\'t appear to be working.',113),(1916,4,'Cosmos',1,1,6,6,'Re: Delkar (#113)','\r  Issue has been fixed completely this time; it seems\r  there was a map error not allowing you to access the\r  next part of that. It has been tested and works now.',114),(1917,4,'Elix',0,0,6,6,'Elemental Emanation','Nothing wrong, but I\'m curious if its possible to have a notification in the status box when the totems reach certain levels.\r\r\rExample: \r\rWhen the totem has 50% mana or health it will notify you in the status box, Once again at 25% and once more when its at 5% or 10%.\rIt could also just Say this in blue text if it would be easier.\r\r\rI does flash its health gage when it drops, but sometimes its hard to tell when there are mobs surrounding it. Also knowing the levels of its mana would be helpful in maintaining a cycle, and help with your Omni/Frostfire cycle aswell.\r\rI dont know where else to put this idea, but if its possible and not to much trouble it would greatly improve the Elementailist playstyle.\r\rJust a thought I had from playing.\rThanks for reading =)\r\rElix\r',115),(1918,4,'Elix',0,0,6,6,'Omniblast/Omnistrike.','Can be casted on self and other player characters.\r\rMeaning you can stack the buff without having to attack anything.\r\rAlso casting Omniblast on yourself/PC removes the stacks without actually casting the spell.\r\rdoing any of this does not cause aethers.\r\rIts not a huge deal, seeing as the damage buff/mana return doesn\'t changed drastically from the stacks.\r\r\r\rI can only see this being a problem at higher Enspells when not getting a full omniblast would cripple your cycle. \r\rJust a FYI',116),(1919,4,'NinjaXxX',0,0,6,6,'Crash','On under water map almost',117),(1920,4,'Cosmos',1,1,6,7,'Re: NinjaXxX (#117)','\r  As in you crashed, or the server?\r\r  On our end, I do not see anything went wrong with\r  the server. It may have been a simple Direct Draw\r  error which tends to happen on occasion..',118),(1922,4,'Atlas',0,0,6,7,'Re:Cosmos','I was with him last night and the server lagged out a few times when we were there. We both disconnected.\r\r\r Unless it\'s a coincidence which is possible.',119),(1923,4,'Cosmos',1,1,6,7,'Re: Atlas (#119)','\r  From what I can see in the log, it appears to be a small\r  hiccup from the hosting server rather than an actual\r  crash of the server/game.',120),(1933,4,'Brancrese',0,0,6,13,'Coal Issues/Ore chest','The existence of Coal defeats the purpose of the Ore chest, as it forces you to return once your full on coal anyway.\r\rIf I can stack 500 Ore in a chest, but I can only stack 100 Coal without returning to the inn to depo, that means I can\'t actually smelt all 500 Ore without a return trip. There\'s a 2/1 ratio in Ore/Coal when smelting, so I\'m forced to return every 200 Ore and either smelt it, or depo the Coal so I can smelt the whole 500 later.\r\rThis inherently defeats the entire purpose of the chest, to be able to continue gathering without having to return to unload. \r\rThe coal, while I understand it\'s practical purpose in the game world (how can you heat a forge without a heat source), I believe either needs to be a purchasable item from the Smith NPC. Or, at the very least, change it\'s max stack to 250, so you could actually gather enough coal in a trip, to handle all the Ore you can fit in the chest.\r\rAddtionally, a stack of Coal costs 10k to depo, this seems and absurdly high cost, and essentially forces you to smelt each load of Ore immediately. I haven\'t ran all the numbers, but in experience I\'d say on the 200 ore you could smelt with 100 coal, you could probably make 20-25k on it in selling the items. So, if you didn\'t smelt/smith immediately, and depoed the 100 coal, you\'d essentially be cutting your profit about in half.\r\rAgain, this further defeats any and all purpose of the chest even existing, as you can\'t actually mine 500 Ore straight in practicality, without either throwing away the ores (in which case, why put them in the chest at all), or taking substantial loses in depo costs.',121),(1935,2,'August',1,1,6,13,'A Storm Approaches...','\rGreetings Citizens of Han!\r\rEarlier this morning a low rumble was heard throughout the kingdom originating from the northeast. As we all know the lands are rich with magic, and it seems that some of the dormant energies throughout the lands have empowered some of the monsters.\r\rThese monsters are granting players with a bonus of experience upon defeat... it seems like there just may be something looming on the horizon!\r\r(( For the next week players will gain a bonus to defeating monsters if they are below level 99. This bonus applies to all monsters and does not diminish within parties, so grab your friends and form up! ))\r\rMore fun to come in the next few days as well!\r\rAugust',74),(1936,111,'Thomstel',0,0,6,13,'The Sight','\r\r\r\rWe, as Seers, carry a heavy burden. \r\r\rCertain aspects of our world that has been hidden away from all others lay in plain sight to us. We view things unlike any other who walk this realm because our vision is embolded with truth.\r\r\rBe it foresight to avoid future peril, or knowledge of the intricacies of the past to lead us towards a brighter future... no two of us are the same. Which is why it is imperative to continually share our knowledge, and build a hive library of our pursuits so that we may be the gatekeepers of this world.\r\rMay we always use our insight for the betterment of this life, and the life beyond, whatever may await us.\r\r\rBe strong my brothers, my sisters. Many will fail to understand or believe in our insights....we must prevail against even the most threatening of odds.\r\r\rThomstel\r',1),(1937,4,'Saii',0,0,6,13,'Bonus EXP','Rogues don\'t get bonus exp if they are invisible',122),(1938,4,'August',1,1,6,13,'Re: Saii','Fixed.',123),(1939,107,'Ahok',0,0,6,14,'SPARTANNNNNN!!!','Fresh Blood!',3),(1941,4,'Lavitz',0,0,6,14,'Precision','At the level you learn Precision, a rogue does not have enough mana to actually cast it.\r\rAt level 5 I have 196 mana, Precision was given from the NPC when you first become a rogue. When attempting to cast Precision I recieve the \"Not enough mana\" message.',124),(1942,112,'Ceto',0,0,6,14,'Hellooo','\r\r\r\r\r\r\r\r\r\r\r\r                           Hai',4),(1943,4,'Runkadunk',0,0,6,14,'Question on objects','Objects in the game including NPC, mobs, trees, and etc. Things which are targetable show up or disappear intermittently. This could be related to my own system. I\'m running it through WINE on Unix.\r\rAlso the mobs can be in different coordinates on my screen than they really are on the server. Refresh fixes it temporarily.\r\rI\'m using the client from http://empireofhan.com\r\rI don\'t see any updater that can fix client problems if there are any.\r\rDoes anyone else have that problem? It could just be my weird setup.',125),(1944,4,'Cosmos',1,1,6,15,'Re: Brancrese (#121)','\r  Coal deposit fee has been lowered.',126),(1945,4,'August',1,1,6,15,'Re: Flashing Mobs/Npcs','\rRunkadunk, I sent you an nmail on how you may be able to correct this by searching for a similar work around.\r\rUnfortunately the installer only corrects this issue on Windows systems.\r\rAugust',127),(1946,4,'Thomstel',0,0,6,15,'Path Weapon','\rNot accepting dreambender or bloodseeker on my seer/archer\r\rto be turned in to claim their path weapons.',128),(1947,4,'Cosmos',1,1,6,15,'Re: Thomstel (#128)','\r  It has been fixed, you can now use bonded and non-bonded\r  95 weapons for the quest.',129),(1948,2,'August',1,0,6,15,'Wigs and Beards','\r\rSister So in the Sister Sing and So Salon has discovered the art of wig (and beard) making. How fascinating!\r\rAugust',75),(1949,6,'Ceto',0,0,6,15,'Gotee','\r\r\r There is a Gotee in the auction house for 10k ;p\rThey don\'t fit on the ladies Fyi lolo',1),(1950,1,'Runkadunk',0,0,6,16,'Group play','To your knowledge or in your opinion do you think the classes are designed to play together well? Do you think they are best done solo?\r\rWhatever else you want to add to that I would be interested to read. Thank you.\r\r-Runkadunk',20),(1951,6,'Runkadunk',0,0,6,16,'Need ideas','I\'m leveling up and usually I sell what I find to NPCs. I\'m glad that they will buy but I would rather sell it to a real player.\r\rIf there is something you want I will save it for you.\r\r-Runkadunk',2),(1955,4,'Miracle',0,0,6,17,'Lvl 95 bow','doesnt add vita/mana like other lv 95 weapon',132),(1958,4,'Brancrese',0,0,6,17,'Exp Rates - Reduction in Ruins','Not sure if you\'re currently making changes and it\'s not complete, but currently, I just killed a mob in the first room, the exp is showing the following:\r\rPirate: 215250\rUW: 420000\rRuins: 314999\r\rNot sure if this is still a work in progress, or maybe Ruins/UW were switch accidentally or something? But clearly Ruins should be higher, given it\'s a higher tier cave.\r\rEdit: Other players are reporting seeing normal exp rates (450/470k) in first room Ruins.\r\rEdit 2: I killed a single mob on my Poet, and got 450k.\r\rDid you apply some form of stat based reduction in exp? Can you please clarify this? Why is this only happening in Ruins? I\'ve tested in Pirates and UW, and I get the exact same amount of exp on both chars.',133),(1959,4,'Cosmos',1,1,6,17,'Re: Miracle (#132)','\r  Issue has been resolved; however it will not show\r  when you highlight (right click) the item until a\r  hard reset occurs.',134);
